(1, 98, 'aiuti dallo stato', 'sono disoccupato da 17 mesi. Mi sono licenziato per motivi personali. E quindi senza alcuna forma di assistenza e  disoccupazione. Ho 56 anni e non ho trovato nessun lavoro. Come faccio ad arrivare all\'et pensionabile ( 67  anni ) ? Come  possibile che una nazione civile permetta che io muoia di fame e non mi dia possibile di vivere decorasomente? Persino gli extracomunitari hanno assistenza.. e io con 31 di contributi nulla???', '2017-03-24 19:14:00', 171, -3, -1),
(2, 170, 'Conferma Profilo Utente', 'Buongiorno Sig.ra Favilla,\r\n\r\ncon la presente per informarla che occorre attivare il suo profilo utente per completare l\'iscrizione.\r\nNella mail di avvenuta iscrizione, dovr attivare il profilo cliccando sul link presente nel testo della mail.\r\n\r\nLa ringrazio per la cortese collaborazione.\r\n\r\nCordiali Saluti', '2017-03-27 08:28:00', 119, -24, -1),
(3, 170, 'Conferma Profilo Utente', 'Buongiorno Sig.ra Montecchiani,\r\n\r\ncon la presente per informarla che occorre attivare il suo profilo utente per completare l\'iscrizione.\r\nNella mail di avvenuta iscrizione, dovr attivare il profilo cliccando sul link presente nel testo della mail.\r\n\r\nLa ringrazio per la cortese collaborazione.\r\n\r\nCordiali Saluti', '2017-03-27 08:28:00', 105, -24, -1),
