(7, 187, 'Info', 'Come funziona ', '2017-03-27 15:42:00', -1, -1, -1),
(8, 6, 'RE: Info', 'Buongiorno Jessica,\n                  al seguente link trova tutte le informazioni inerenti il progetto. \nhttp://clickdayats.it/faq\n\nSar nostra cura tenervi aggiornati nelle settimane successive\n\nSaluti Cordiali\nAlessandro', '2017-05-15 19:59:14', 187, -27, 7),
(9, 254, 'caricamento contratto', 'salve ho scaricato il contratto e firmato ma non riesco a caricarlo ne in formato pdf ne come jpag.\r\nmi potreste dare indicazioni in merito.\r\ngrazie', '2017-03-28 12:35:00', -1, -1, -1),
(10, 281, 'mi sono registrata', 'Salve Mirko,mi sono registrata.\r\nIl prossimo passo qual\'e\'?Devo attendere la data prefissata?', '2017-03-28 13:58:00', 170, -3, -1),
(11, 170, 'RE: mi sono registrata', 'Esattamente, Sig.ra Pavani.\r\n\r\nCordiali Saluti\r\n', '2017-03-28 14:35:00', 281, -24, 10),
(12, 327, 'Info', 'Buongiorno, di cosa si tratta?', '2017-03-28 16:32:00', -1, -1, -1),
(13, 6, 'RE: Info', 'Buongiorno Rodolfo, al seguente link trova tutte le informazioni inerenti il progetto. http://clickdayats.it/faq\r\nSar nostra cura tenervi aggiornati nelle settimane successive!\r\nSaluti Cordiali\r\nAlessandro', '2017-03-28 16:34:00', 327, -27, 12),
(14, 6, 'RE: mi sono registrata', 'Buongiorno Ambra, sar nostra cura aggiornarvi nelle prossime settimane sia sulla procedura di invio sia ovviamente sulla data ed orario esatto del clickday. Inoltre sulla nostra pagina facebook https://www.facebook.com/clickday/?fref=ts trover aggiornamenti sistematici\r\nRimango a disposizione\r\nMirko', '2017-03-28 16:38:00', 281, -27, 10),
(15, 327, 'RE: RE: Info', 'Grazie Alessandro, potrei sapere se il pagamento della prestazione avviene solo se i progetti che caricheremo saranno ammessi al contributo oppure se saremo retribuiti a prescindere dall\'esito?', '2017-03-28 16:57:00', 6, -23, 12),
(16, 6, 'RE: RE: RE: Info', 'Buonasera Rodolfo, qui trovi tutte le specifiche:\r\nhttp://clickdayats.it/##comeGuadagni\r\nClicca su Continua a leggere per i dettagli\r\n\r\nSaluti\r\nAlessandro', '2017-03-28 17:47:00', 327, -27, 12),
(17, 6, 'RE: caricamento contratto', 'Buonasera Stefano,\r\n             abbiamo aggiornato il contratto con la normativa 2017, stanotte caricheremo la versione aggiornata sulla piattaforma. Da domani sar possibile caricarla sul portale. Se riscontrasse altri problemi mi faccia sapere.\r\n\r\nSaluti\r\nAlessandro', '2017-03-28 17:49:00', 254, -27, 9),
(18, 381, 'codice click master', 'Buongiorno, \r\nchiedo scusa, ho sbagliato e non ho inserito il codice click master;  possibile reinserirlo?\r\n\r\nGrazie', '2017-03-29 08:49:00', -1, -1, -1),
(19, 425, 'registrazione', 'salve\r\nho effettuato registrazione ora attendo le vostre istruzioni?', '2017-03-29 11:15:00', 170, -3, -1),
(20, 254, 'RE: RE: caricamento contratto', 'salve proprio ora ho provato a caricare il contratto firmato ma ancora non riesco ad inviarvelo\r\nmi pu dare indicazioni su come inviarvelo\r\n', '2017-03-29 11:40:00', 6, -23, 9),
(21, 432, 'Richiesta ', 'Ciao \r\nscusate il disturbo, non riesco ad inserire il contratto firmato.\r\nIl mio file  un pdf di 944 kb. Come posso fare?\r\nGrazie mille\r\nDebora', '2017-03-29 11:46:00', 170, -3, -1),
(22, 170, 'RE: registrazione', 'Salve Martina,\r\n\r\nesattamente, la informeremo noi in merito alla data del Click Day.\r\n\r\nSaluti', '2017-03-29 12:27:00', 425, -24, 19),
(23, 170, 'RE: Richiesta ', 'Salve Debora,\r\n\r\nil contratto sar disponibile a partire da luned prossimo.\r\n\r\nLa ringraziamo per la collaborazione.\r\n\r\nCordiali Saluti\r\n', '2017-03-29 12:28:00', 432, -24, 21),
(24, 6, 'RE: codice click master', 'Buongiorno Rosaria, nessun problema, se si ricorda il codice me lo invii altrimenti la assoceremo automaticamente senza alcun problema.\r\nMi faccia sapere, grazie\r\nSaluti\r\nAlessandro', '2017-03-29 14:05:00', 381, -27, 18),
(25, 6, 'RE: registrazione', 'Buongiorno Martina, sar nostra cura aggiornarvi nelle prossime settimane sia sulla procedura di invio sia ovviamente sulla data ed orario esatto del clickday. Inoltre sulla nostra pagina facebook https://www.facebook.com/clickday/?fref=ts trover aggiornamenti sistematici\r\nRimango a disposizione\r\nSaluti\r\nAlessandro', '2017-03-29 14:12:00', 425, -27, 19),
(26, 6, 'RE: RE: RE: caricamento contratto', 'Buongiorno Stefano, abbiamo ancora alcuni problemi di upload, mi scuso, se non le  disturbo me lo invii pure via posta elettronica a alessandrofaletti@atseco.it\r\nLe confermer poi la ricezione\r\nSaluti Alessandro', '2017-03-29 14:14:00', 254, -27, 9),
(27, 6, 'RE: Richiesta ', 'Buongiorno Debora, abbiamo ancora alcuni problemi di upload del contratto che stiamo risolvendo, mi scuso. Se non le  disturbo me lo invii pure via posta elettronica a alessandrofaletti@atseco.it Le confermer poi la ricezione Saluti Alessandro', '2017-03-29 14:17:00', 432, -27, 21),
(29, 174, 'Grande!', 'Grazie per esserti iscritto! Fai iscrivere anche altre persone che conosci e sai che sono brave col pc\r\nhttp://clickdayats.it/signup06AC\r\nAntonio Calabrese', '2017-03-29 14:28:00', 138, -24, -1),
(30, 501, 'Contratto caricato', 'Salve, ho caricato il contratto controfirmato nel mio spazio personale. Resto in attesa di nuove disposizioni in merito.\r\nSaluti\r\nAlessandra', '2017-03-29 22:55:00', 170, -3, -1),
(31, 6, 'RE: Contratto caricato', 'Buongiorno Alessandra, sar nostra cura aggiornarvi nelle prossime settimane sia sulla procedura di invio sia ovviamente sulla data ed orario esatto del clickday. Inoltre sulla nostra pagina facebook https://www.facebook.com/clickday/?fref=ts trover aggiornamenti sistematici Rimango a disposizione\r\nSaluti\r\n Alessandro', '2017-03-30 07:00:00', 501, -27, 30),
