(54, 6, 'RE: info ', 'Buongiorno Francesco,\r\n          il codice progetto lo ricever successivamente non prima del 12 giugno,  data in cui l\'INAIL comunicher il giorno e l\'ora esatta del clickday. Nel frattempo la aggiorneremo sull\'attivit e produrremo un tutorial video molto semplice inerente la procedura di invio del codice. Sulla nostra piattaforma trova tutte le informazioni del caso:\r\nhttp://clickdayats.it/##comeFunziona\r\nIntanto pu anche seguire la nostra pagina facebook: https://www.facebook.com/clickday/?fref=ts\r\n\r\nRimango a disposizione\r\nSaluti\r\nAlessandro', '2017-03-30 15:20:00', 636, -27, 34),
