(58, 6, 'RE: Prima Iscrizione', 'Buongiorno Fiorenzo,\r\n               forse la conferma di attivazione  finita per errore nella sua posta indesiderata. Le confermo la corretta registrazione. Al seguente link trova tutte le informazioni inerenti il progetto. http://clickdayats.it/faq \r\nSar nostra cura tenervi aggiornati nelle settimane successive \r\nSaluti Cordiali Alessandro', '2017-03-31 06:13:00', 618, -27, 55),
