(62, 618, 'RE: RE: Prima Iscrizione', 'Un ultima domanda: il contratto firmato da compilare e caricare sulla piattaforma  quello che trovo nella sezione faq (anche se riporta come anno il 2016)? o verra inviato da Voi in qualche modo? \r\n\r\nGrazie', '2017-03-31 12:22:00', 6, -23, 55),
(64, 6, 'RE: RE: RE: Prima Iscrizione', 'Il contratto, compilato automaticamente con i suoi dati, lo pu scaricare dalla sua area personale, firmare e caricare sempre dall\'area personale. Il riferimento BANDO ISI INAIL 2016 riguarda il fatto che l\'Avviso Pubblico  stata pubblicato a dicembre 2016 per l\'anno 2017.\r\nPer qualunque informazione aggiuntiva siamo a disposizione\r\nSaluti\r\nAlessandro', '2017-04-04 09:35:00', 618, -27, 55),
(65, 169, 'RE: informazioni', 'Gentile Raffaella, non ti preoccupare: il contratto dovr essere firmato solo in caso di click vincente, quindi ti manderemo una comunicazione in merito al momento opportuno.\r\nTi spiegheremo in futuro anche come inviare lo screenshot post click day: tutte le comunicazioni ti verranno recapitate via portale e verrai formata nel miglior modo possibile per lo svolgimento del lavoro.\r\nGrazie e buona giornata!', '2017-04-04 10:22:00', 689, -24, 53),
