(114, 6, 'Cosa fare ora che ti sei iscritto a Click Day?', 'Ciao! Ora che ti sei iscritto a Click Day 2017 non ti rimane altro che fare tre cose: 1) verifica di averci mandato il contratto firmato - se non lavessi ancora fatto provvedi caricandolo dalla tua area riservata nellapposito campo; 2) segui la nostra pagina Facebook dove troverai tante informazioni utili sul progetto e qualche consiglio su come fare il click pi veloce; 3) attendi altre nostre comunicazioni future tra cui un tutorial video molto semplice che ti spiegher passo dopo passo cosa dovrai fare il giorno del click day. Ricordati che fino al 12 giugno non si sapr la data esatta del click day.\r\nPagina Facebook di Click Day ATS (se non si visualizza direttamente cliccando, copia ed incolla il seguente link sul tuo browser): https://www.facebook.com/clickday/\r\nCiao e a presto\r\nLo Staff Click Day ATS', '2017-04-12 13:20:00', -1, -15, -1),
