(142, 204, 'Impossibilit di modificare i dati', 'Non si riescono a modificare i dati personali , in quanto nella pagina apposita una volta modificati e cliccato su modifica ti da sempre un errore. Inoltre nella stessa pagina sono presenti strane righe con contenuti informatici.  Attendo comunicazione del problema oppure se me la volete cambiare voi il mio anno di nascita  il 1973 e non il 1972  come ora segnato. Il giorno e il mese di nascita  invece vanno bene', '2017-04-13 08:24:00', 177, -3, -1),
