(159, 3410, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buonasera,\r\nho caricato solo l\'ultimo foglio del contratto, dove ho messo la firma autografata. Dovrei caricare anche i primi due fogli del contratto? Grazie mille e a presto.\r\nCordiali saluti.\r\n\r\nDomenico Giampetruzzi', '2017-04-13 17:08:00', 6, -23, 114),
