(190, 6, 'RE: Informazioni', 'Buongiorno Roberto,\r\n              il codice inerente la domanda di progetto viene attribuita a pi cliccatori ma essendo lintera procedura INAIL basata sui tempi generali regionali, questo non comporta nessuna differenza per il singolo cliccatore.\r\nPu utilizzare qualunque sistema operativo lei desideri mentre come browser di navigazione lEnte consiglia Chrome (anche noi) oppure Explorer. Rimango a disposizione. \r\nSaluti Cordiali', '2017-04-18 10:33:00', 3448, -27, 185),
(191, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Per accedere alla sua area riservata basta che utilizzi le credenziali da lei inserite al momento della registrazione e effettuare il login da: http://clickdayats.it/# cliccando su area personale. L trover anche il contratto\r\nRimango a disposizione\r\nSaluti Cordiali\r\nAlessandro', '2017-04-18 10:36:00', 3458, -27, 114),
