(197, 3498, 'CONTRATTO FIRMATO DA MARTINO LUCIA', 'BUONGIORNO HO SCARICATO IL CONTRATTO FIRMATO E DATATO CARICATO NELL AREA MIA PERSONALE ORA A CHI DEVO INVIARLO?MI PUO MANDARE L INDIRIZZO E MAIL A CUI INOLTRARLO?GRAZIE.', '2017-04-19 14:20:00', 6, -23, 114),
