(226, 3679, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Gentile Sig. Alessandro,\r\nho riscontrato sul web diverse Vostre richieste di cliccatore\", provenienti da pi sedi (Verona, Bologna ecc...). Le chiedo se fosse tecnicamente e legalmente possibile svolgere il compito richiesto per 2 o pi sedi.\r\nLa ringrazio e Le auguro una buona giornata.\r\nRoberto.', '2017-04-26 09:58:00', 6, -23, 114),
