(229, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Rosa,\r\n           lo pu scaricare, gi compilato con i suoi dati, accendendo alla sua area personale sul nostro portale http://clickdayats.it/. Poi sempre dalla medesima area, una volta firmato, lo potr caricare. Grazie. Saluti Cordiali Alessandro', '2017-04-26 10:54:00', 3670, -27, 114),
(230, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Roberto,  un\'attivit che pu essere effettuata da qualunque luogo il cliccatore preferisca (casa, lavoro, altro). Per questo la nostra campagna  su territorio nazionale. Ogni cliccatore per pu avere un solo codice progetto.\r\nRimango a disposizione Saluti Alessandro', '2017-04-26 10:56:00', 3679, -27, 114),
