(233, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Gino,\r\n         le pu scaricare dalla sua area personale http://clickdayats.it/# , utilizzando le credenziali che le abbiamo inviato via e-mail a seguito della sua registrazione, per scaricare il suo contratto gi compilato ed inviarcelo firmato sempre con l\'apposita funzione che trova nella sua area  riservata. Seguiranno poi nostre comunicazioni future sul progetto. Rimango a disposizione. Saluti Cordiali. Alessandro', '2017-04-26 12:09:00', 3686, -27, 114),
