(268, 44, 'Invio contratto firmato', 'Ho tentato per due volte di inviarvi il contratto firmato e per due volte mi ha dato \"un errore inaspettato, probabilmente il file selezionato non  corretto\". Non so cosa si intenda per corretto, la prima volta era in Word e la seconda in PDF. Come potrei fare, forse inviarlo per e-mail? Grazie.\r\n', '2017-04-28 16:18:00', 170, -3, -1),
(270, 3786, 'richiesta cortese verifica caricamento contratto sottoscritto', 'Gentili, potreste confermarmi di aver ottenuto il mio contratto firmato? Credo di poter caricare solo l\'ultima pagina...il mio scanner mi ha suddivise le pagine e il sito non acquisisce che un doc...', '2017-04-29 14:58:00', 178, -3, -1),
(271, 3790, 'Informazioni', 'Ciao, mi sono appena iscritta e leggero quanto prima il contratto per girarvelo firmato. Mi chiedevo come clickday ce ne sono pi di uno durante L anno? Chiedo Dato che sono inesperta :-) grazie ', '2017-04-29 15:48:00', 170, -3, -1),
