(281, 3784, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno, \r\nho visualizzato e letto il contratto ed ho visto che non  stato caricato il mio codice fiscale. Si pu inserire? Grazie e buona giornata', '2017-05-02 06:05:00', 6, -23, 114),
(284, 6, 'RE: Screenshot', 'Buongiorno Fauso, lo screenshot andr caricato alla fine della procedura di invio del codice progetto.  Seguiranno nei prossimi giorni tutte le informazioni necessarie per spiegare la procedura di invio e un semplice tutorial video. Rimango a disposizione\r\nSaluti Cordiali\r\nAlessandro', '2017-05-02 09:25:00', 3758, -27, 278),
(285, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Nessun problema Susanna, in molti utenti non l\'hanno,  invieremo nei prossimi giorni informazioni inerenti la procedura di invio dei progetti e un video tutorial molto semplice che spiegher tutto. Saluti Cordiali. Alessandro', '2017-05-02 09:26:00', 3806, -27, 114),
(286, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Certo, pu anche scriverlo a mano ed inviarlo in allegato via mail ad info@clickdayats.it se le fa comodo. Le risponderemo con una conferma di ricezione.\r\nSaluti Cordiali.\r\nAlessandro ', '2017-05-02 09:28:00', 3784, -27, 114),
(287, 3606, 'caricato contratto', 'Ciao, ho caricato il contratto modificato con gli importi ricalcolati da Silvia Bertani per l\'agevolazione fiscale, con gli allegati in coda. Se servisse altro fatemi sapere! \r\nGrazie di tutto, Petra', '2017-05-02 10:13:00', 169, -3, -1),
(288, 169, 'RE: caricato contratto', 'ciao Petra,\r\nora non ti resta che cliccare veloce e portare a casa il risultato!\r\nKeep Calm & Click Fast\r\nPaolo', '2017-05-02 10:15:00', 3606, -24, 287),
(289, 3817, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno, io ho firmato il contratto ma non ho capito una cosa, nel punto 5.1 c\' scritto \"Il compenso verr quindi corrisposto se ricorrono le condizioni su elencate, solo successivamente alla pubblicazione dei risultati\"  Quindi il mese successivo? (luglio)\r\nPoi c\' scritto: \"Il committente si impegna a versare quanto di sua competenza stabilito dalle normative in essere\". Quindi la ricevuta d\'acconto che fate voi  gi tassata o poi dovr farlo io l\'f24 per pagarle?  Grazie mille, caricher il contratto firmato il prima possibile.', '2017-05-02 11:22:00', 6, -23, 114),
(290, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Deborah,\r\n            il compenso verr erogato  a mezzo di bonifico bancario, entro 30 giorni dalla data di pubblicazione degli elenchi crononologici INAIL; tale  pubblicazione avverr entro 7 giorni dalla data del clickday che appunto l\'INAIL ci comunicher a partire dal 12 giugno 2017. Facendo un esempio, se la data del clickday fosse il 19 giugno, gli elenchi sarebbero pubblicati entro il 26 giugno e il suo compenso, se il progetto a lei assegnato sar tra i pi veloci quindi otterr l\'ammissione a contributo, verr erogato entro il 26 di luglio.\r\nRimango a disposizione.\r\nSaluti Cordiali.\r\nAlessandro', '2017-05-02 12:54:00', 3817, -27, 114),
(291, 3784, 'RE: RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buon pomeriggio,\r\nmi scuso per il disturbo ma ho un problema con lo scan e non riesco a caricare il contratto....c\'  un\' altro modo di invio?\r\nGrazie\r\nGiliola', '2017-05-02 13:15:00', 6, -23, 114),
(292, 3827, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Salve, il contratto l\'ho caricato, ma lo Screenshot qual ?', '2017-05-02 13:59:00', 6, -23, 114),
(293, 6, 'RE: RE: RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Giliola,\r\n            pu fare una fotografia all\'ultima pagina con le firme ed inviarla via email a info@clickdayats.it in allegato.  Le risponderemo con la conferma di ricezione.\r\nSaluti Cordiali\r\nAlessandro', '2017-05-02 14:36:00', 3784, -27, 114),
(294, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Annamaria,\r\n         lo screenshot andr effettuato alla fine della procedura di invio del codice progetto nella data che verr comunicata dall\'INAIL a partire dal 12 giugno 2017. VI invieremo anche un tutorial video molto semplice che vi spiegher la procedura.\r\nSaluti Cordiali\r\nAlessandro', '2017-05-02 14:38:00', 3827, -27, 114),
(295, 3840, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Spettabile Azienda\r\nOra ho preso lettura della Vostra email con la risposta alla mia candidatura come ADDETTO INSERIMENTO DATI. Ho seguito le indicazioni ed ho effettuato la registrazione sul sito \"CLICKDAY\". Mi scuso molto per il ritardo la mi era sfuggita l\'email tra quelle ricevute, essendovene state molte in arrivo. Allego nel mio profilo il contratto di collaborazione firmato. Resto a diposizione per qualsiasi informazione o aggiornamento sulla data sicura del CLICKDAY e inoltre vorrei sapere di pi come procedere operativamente alla mansione ossia come effetuare l\'invio telematico della documentazione oggetto dell\'incarico. In attesa porgo i miei pi cordiali e distinti saluti.\r\n\r\nCONSUELO PRESTERA\'                                                                                    Catanzaro, 02/05/2017', '2017-05-02 20:14:00', 6, -23, 114),
(296, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Consuelo,\r\n             grazie per aver aderito, nei prossimi giorni vi invieremo informazioni dettagliate in merito al progetto e, non appena pronto, un video tutorial molto semplice che vi spiegher la procedura di invio.\r\nSaluti Cordiali. Alessandro', '2017-05-03 09:53:00', 3840, -27, 114),
(297, 3853, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Scusi tanto se disturbo , ma per chi nn ha facebook? quale altro canale di informazione posso consultare? Distinti saluti', '2017-05-03 09:55:00', 6, -23, 114),
(298, 3840, 'RE: RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'La ringrazio molto per la sua disponibilit e  buon lavoro!\r\n\r\nCONSUELO PRESTERA\'', '2017-05-03 09:57:00', 6, -23, 114),
(299, 170, 'RE: Invio contratto firmato', 'Salve Ilaria,\r\n\r\ns, pu tranquillamente girarlo tramite mail a mirkograiani@atseco.it\r\n\r\nLa ringrazio, saluti.\r\n', '2017-05-03 12:05:00', 44, -24, 268),
(300, 170, 'RE: Informazioni', 'Salve Rosalba,\r\n\r\nsfortunatamente, il click day si svolge una volta all\'anno.\r\n\r\nSaluti', '2017-05-03 12:06:00', 3790, -24, 271),
(301, 741, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'grazie', '2017-05-03 13:07:00', 6, -23, 114),
(302, 3806, 'RE: RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Alessandro,\r\nho caricato il contratto firmato. Volevo avvisarla che, pur essendo disoccupata, ho partita iva e sono in regime forfettario pertanto non sono soggetta all\'applicazione dell\'iva ma solo ad un bollo di 2 euro che devo applicare sulla fattura originale e riportare l\'id nella mia copia\r\ncordiali saluti', '2017-05-03 13:13:00', 6, -23, 114),
(303, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Non si preoccupi, molti non hanno Facebook, penseremo noi nei prossimi giorni ad aggiornarvi via mail e invieremo, appena pronto invieremo anche  un video tutorial molto semplice che spiegher la procedura. Saluti Cordiali. Alessandro', '2017-05-03 13:46:00', 3853, -27, 114),
(304, 6, 'RE: RE: RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Nessun problema, nel caso il suo click risultasse vincente, se preferisce, potr emettere fattura. A sua discrezione.\r\nSaluti Cordiali.\r\nAlessandro', '2017-05-03 13:47:00', 3806, -27, 114),
(305, 3884, 'problemi caricamento contratto', 'buona sera,\r\nho provato a caricare il contratto firmato come pdf,  ma il sito al termine dell\'inserimento mi restituisce un messaggio d\'errore.\r\nesiste un altro metodo per trasmettervi il contratto\'\r\n\r\nringrazio e rimango in attesa di un vostro gentile riscontro.', '2017-05-03 19:07:00', 170, -3, -1),
(306, 3677, 'Prestatore con Partita IVA', 'Alla c.a della ATS Consulenti Associati e del Sig. Graiani M.,\r\n                          con la presente per informare di aver provveduto a caricare il contratto  di collaborazione e per rendere noto che il sottoscritto  un libero professionista con Partita IVA in regime de \"minimi\" e pertanto non soggetto a ritenuta d\'acconto e no IVA ma solo rivalsa INPS 4%.  Si chiede se  necessario predisporre altra forma di contratto (aggiornato con numero di partita IVA). Inoltre, nel caso di specie, e semmai ricorrano i presupposti di cui all\'art. 5 del contratto per l\'ottenimento del corrispettivo, quest\'ultimo sar liquidato solo a seguito di emissione di fattura. Si chiede su quale importo  375+4%?\r\nIn attesa di risposta, porgo\r\nCordiali saluti\r\nSerafino Di Paola ', '2017-05-04 07:21:00', 170, -3, -1),
(307, 3889, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Alessandro,\r\n\r\nContratto firmato caricato ed inviato. In attesa di nuove indicazioni le auguro una buona Giornata. Pierpaolo', '2017-05-04 08:04:00', 6, -23, 114),
(308, 3548, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno,\r\nmi sono iscritta al sito per diventare cliccatore quasi un mese fa ma non ho ancora eseguito l\'upload  del contratto. Sono ancora in tempo per diventare cliccatrice o, essendo passati 5 giorni dall\'iscrizione, il contratto  nullo?\r\nCordiali saluti, Luisa', '2017-05-04 10:33:00', 6, -23, 114),
(309, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Nessun problema Luisa, abbiamo sollecitato perch in molti non caricano il contratto anche se effettuano comunque la prestazione.  Lo mandi pure.\r\nGrazie\r\nRimango a disposizione.\r\nSaluti Cordiali.\r\nAlessandro', '2017-05-04 12:14:00', 3548, -27, 114),
