(317, 170, 'RE: Prestatore con Partita IVA', 'Buongiorno Sig. DiPaola,\r\n\r\nproceda pure con il caricamento del contratto.\r\nIn caso di esito positivo del click,  emetter regolare fattura come da suo regime, e corrisponderemo un lordo effettivo  di 375 euro comprensivo del 4%.\r\n\r\nCordiali', '2017-05-05 10:33:00', 3677, -24, 306),
(318, 3939, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno volevo un\'informazione il pagamento dei 375 euro lordi, sar fatto solo in caso di vincita del clickday o in maniera indipendente dall\'esito?\r\nQuale sar la forma di pagamento attraverso la comunicazione dell\'Iban?.\r\nIn attesa, di una Vostra cordiale risposta, Vi invio cordiali saluti.', '2017-05-05 14:03:00', 6, -23, 114),
(319, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Alessia,\r\n          il pagamento sar erogato a mezzo di bonifico bancario nel caso in cui il codice progetto a lei associato venga inviato nel tempo utile per l\'ottenimento del contributo INAIL dell\'azienda cui si riferisce. Qui trova molte risposte: http://clickdayats.it/faq. Saluti Cordiali\r\nAlessandro', '2017-05-05 14:07:00', 3939, -27, 114),
