(361, 3939, 'RE: RE: Problemi con il contratto da scaricare', 'La ringrazio per la disponibilit .\r\nAttendo la giornata di domani per verificare la risoluzione del problema ed ovviamente, darLe conferma dell\'avvenuto successo.\r\nLe auguro una buona giornata.\r\n\r\nCordiali saluti\r\n\r\nde Falco Alessia', '2017-05-08 14:07:00', 171, -22, 334),
(362, 3939, 'Risoluzione del problema del contratto', 'Ho appena verificato la risoluzione del problema.\r\nIl contratto riesco a visualizzarlo. \r\nSar mia cura, inviarlo di nuovo firmato e scansionato entro la giornata di domani.\r\nLa ringrazio ancora e Le auguro una buona giornata.\r\n\r\nCordiali saluti\r\n\r\nde Falco Alessia', '2017-05-08 14:10:00', 171, -3, -1),
