(365, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Antonio,\r\n          il contratto lo pu scaricare gi compilato con i suoi dati dalla sua area riservata sulla nostra piattaforma clickdayats.it .\r\nRimango a disposizione\r\nSaluti Cordiali\r\nAlessandro', '2017-05-08 17:34:00', 3998, -27, 114),
(366, 6, 'AGGIORNAMENTI da Click Day 2017', 'Cari Cliccatori, grazie di cuore perch ci state scrivendo veramente in tanti per avere informazioni sul progetto! Ecco quindi un po di aggiornamenti:\r\nPrima buona notizia: al momento  dopo esservi iscritti  non dovete pi fare nulla! Vi aggiorneremo noi.\r\nSeconda ottima notizia: appena possibile vi invieremo una mail con un link dove potrete visionare un video tutorial molto semplice che vi spiegher passo dopo passo cosa dovrete fare il giorno del Click Day, dallinvio del codice progetto a qualche trucchetto su come fare il click pi veloce.\r\n\r\nRicordatevi che la data e lora esatta del Click Day non sono ancora state comunicate.\r\nLINAIL, infatti, lo comunicher a partire dal 12 giugno 2017, quindi possiamo immaginare che il Click Day si attester in una data compresa nelle due settimane successive. In ogni caso, appena lINAIL far il comunicato, invieremo a tutti una mail e lo pubblicheremo sulla pagina Facebook. \r\n\r\nSeguiteci sulla nostra pagina Facebook https://www.facebook.com/clickday/ dove potrete trovare sempre gli ultimi aggiornamenti ed interagire con Mister Clicky che vi aiuter a ripassare le informazioni utili sul progetto, e che trovate anche sul sito http://clickdayats.it/ .\r\n\r\nA presto!\r\nIl Team Click Day 2017\r\n', '2017-05-08 17:45:00', -1, -15, -1),
(367, 17, 'RE: AGGIORNAMENTI da Click Day 2017', 'Grazie mille, aspetto quindi un vostro messaggio per video tutorial e successivamente per confermare il giorno esatto.\r\nVolevo farvi una domanda, c\' rischio che la richiesta INAIL venga annullata se l\'ip dell\'invio di due codici diversi  simile? non proveniente dallo stesso computer ma dallo stesso router', '2017-05-08 19:30:00', 6, -23, 366),
