(392, 3792, 'richeste informazioni', 'Spettabile Societ, \r\nIn merito alla sottoscrizione del contratto, vorrei sapere come deve essere spedita, pu essere consegnata fisicamente, ma pu essere anche spedita con raccomandata, poich io non sono residente in loco. Grazie per la cortese risposta.\r\n\r\n', '2017-05-10 09:46:00', 178, -3, -1),
