(394, 6, 'RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Mohammad,\r\n                   seguiranno  nei prossimi giorni nostre e-mail con informazioni in merito all\'attivit e vi invieremo anche un video tutorial molto semplice che spiegher l\'intera procedura.\r\nRimango a disposizione.\r\nSaluti Cordiali. Alessandro', '2017-05-10 10:56:00', 1239, -27, 366),
