(396, 169, 'RE: Richiesta info', 'certamente, anzi come lo scorso anno manderemo un video tutorial a cui conviene prestare molta attenzione. in quanto, oltre alle indicazioni ufficiali, ci sono le dritte e le esperienze acquisite dai veterani delle passate 7 edizioni.\r\nnon avere fretta per il video, lo invieremo pi avanti comunque con un buon anticipo rispetto il giorno del clickday.\r\nPaolo', '2017-05-10 12:15:00', 4028, -24, 393),
(397, 178, 'RE: richeste informazioni', 'Buongiorno Patrizia,\r\n\r\nsul portale internet, nella sua area personale, c\' un\'apposita area dove caricare il contratto firmato. Se non riesce in quel modo, pu girarlo a me via mail.\r\n\r\nCordiali Saluti', '2017-05-10 12:23:00', 3792, -24, 392);
