(399, 3829, 'Graduatoria cliccatori', 'scusate la domanda, ma come faccio a controllare se rientro tra i cliccatori pi veloci? Esiste una graduatoria che posso consultare oppure me lo comunicate voi?\r\n\r\nGrazie e saluti\r\n\r\nMaria Teresa', '2017-05-10 16:23:00', -1, -1, -1),
(401, 3998, 'Richiesta informazione_Antonio Giammario', 'Scusate riguardo questa dicitura che leggete sotto vorrei sapere ma il della dicitura del progetto che leggete ma quale  questo progetto da presentare?  il progetto riguarda il contratto che ho firmato e caricato?\r\nScusate e chiedo un gentile riscontro.\r\nBuona serata.\r\nCordiali saluti\r\nMAESTRO D\'ARTE (STUDIO DI ARCHITETTURA) \r\n\r\nAntonio GIAMMARIO \r\n\r\nWozz-App: 3291629899 \r\n\r\nFacebook: Antonio Giammario\r\n\r\nSkype : antonio.giammario\r\n\r\nE-mail:aros83.ag@libero.it\r\n\r\nTel.: 329/1629899\r\n\r\n\r\n\r\n\r\nClick Day\r\n23 ore fa  \r\nSe il tuo click risulter vincente, ovvero se il progetto da te inviato otterr lammissibilit al finanziamento dellINAIL, guadagnerai un compenso pari a 300,00 netti ', '2017-05-10 16:44:00', 171, -3, -1),
(403, 6, 'RE: Richiesta info', 'Buongiorno Ettore,\r\n         nei prossimi gironi vi invieremo informazioni in merito ed appena pronto un video tutorial molto semplice che vi spiegher la procedura.\r\nSaluti Cordiali.\r\nAlessandro', '2017-05-10 16:46:00', 4028, -27, 393),
(404, 171, 'RE: Richiesta informazione_Antonio Giammario', 'Buongiorno, \r\nno il progetto  preparato da noi per una nostra azienda.\r\nA questo progetto l\'INAIL abbina un codice ( che le arriver per mail) e che dovr inviare in una pagina INAIL con l\'inserimento e l\'invio..\r\nCordiali saluti', '2017-05-11 07:36:00', 3998, -24, 401),
(405, 3998, 'Grazie_Antonio Giammario', 'B.giorno gentilissimi.\r\nGrazie siete stati impeccabili nella spiegazione e ora ho capito meglio tutto.\r\nB.giornata e restiamo sempre aggiornati.\r\nCordiali saluti.\r\n\r\nMAESTRO D\'ARTE (STUDIO DI ARCHITETTURA) \r\n\r\nAntonio GIAMMARIO \r\n\r\nWozz-App: 3291629899 \r\n\r\nFacebook: Antonio Giammario\r\n\r\nSkype : antonio.giammario\r\n\r\nE-mail:aros83.ag@libero.it\r\n\r\nTel.: 329/1629899', '2017-05-11 07:47:00', 171, -22, 401),
