(407, 169, 'dai forza con la Kilt', 'buona caccia ai cliccatori, Paolo', '2017-05-11 13:31:00', 4155, -24, -1),
(408, 6, 'RE: Screenshot', 'Buongiorno Flavia,\r\n         lo screenshot sara da fare ed inviare alla fine della procedura in data successiva al 12 giugno che vi comunicheremo appena possibile. Vi manderemo anche un video tutorial molto semplice che spiegher tutta a procedura. Intanto sul nostro portale trova tutte le risposte: http://clickdayats.it/faq.\r\nRimango  a disposizione. Saluti Cordiali. Alessandro', '2017-05-11 13:59:00', 3861, -27, 406),
(409, 4149, 'info pagamenti', 'Salve vorrei sapere come viene effettuato il pagamento\r\nGrazie\r\n', '2017-05-11 14:53:00', -1, -1, -1),
(410, 170, 'RE: domanda sul percorso ', 'Buonasera Mirella,\r\n\r\nscusi il ritardo nel risponderle.\r\n\r\nPer adesso, l\'unica posizione aperta  questa, non escludiamo di aprirne altre in futuro.\r\n\r\nSaluti', '2017-05-11 15:29:00', 4023, -24, 375),
(411, 3875, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Ciao Alessandro volevo chiederti un?informazione generalmente sai a che ora si effettua il click?\r\n ', '2017-05-11 16:24:00', 6, -23, 114),
