(413, 6, 'RE: info pagamenti', 'Buongiorno Fabrizio,\r\n         qui trova tutte le risposte (la domanda n. 6) http://clickdayats.it/faq\r\nComunque entro 30 giorni dalla pubblicazione degli elenchi cronologici INAIL che avverr entro 7 giorni dalla data del cliickday.  Il compenso verr erogato a mezzo di bonifico bancario.\r\nRimango a disposizione. Saluti Cordiali. Alessandro', '2017-05-11 18:06:00', 4149, -27, 409),
(414, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buonasera Stefania,\r\n                 negli ultimi 3 anni  stato alle ore 16.00 di gioved. E\' per a discrezione dell\'INAIL per cui non lo prenda come dato certo. Appena sapremo la data e l\'orario esatto ve lo comunicheremo immediatamente.\r\nSaluti Cordiali\r\nAlessandro', '2017-05-11 18:07:00', 3875, -27, 114),
(415, 6, 'RE: RE: RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Daiana,\r\n           deve firmarlo e caricarlo accedendo al portale con le sue credenziali nell\'apposito campo. Se preferisce pu anche inviarlo in allegato all\'indirizzo mail info@clickdayats.it.\r\nLe risponderemo  confermandone la ricezione.\r\nRimango a disposizione. Saluti Cordiali. Alessandro', '2017-05-11 18:08:00', 3944, -27, 114),
(416, 169, 'Vai DRAGO', 'Grandissima Matilde, e anche complimenti a te e Giorgia per l\'encomio al san Giorgio!!!\r\nho visto le foto :-)\r\nPaolo', '2017-05-12 08:04:00', 4165, -24, -1),
