(423, 6, 'RE: caricamento contratto', 'Buongiorno Claudio, la dimensione massima  5MB. Se riscontra problemi lo invii in allegato a info@clickdayats.it, le risponderemo dandole conferma di ricezione.\r\nSaluti Cordiali\r\nAlessandro', '2017-05-13 12:51:00', 4244, -27, 417),
