(435, 6, 'RE: Click master', 'Buongiorno Francesco,\r\n                        non si preoccupi,  il codice clickmaster ha una nostra funzionalit interna, non legata ai cliccatori. Tutti riceveranno le medesime informazioni sia che l\'abbiano inserito sia che non l\'abbiano fatto.\r\nRimango a disposizione\r\nSaluti Cordiali\r\nAlessandro', '2017-05-16 11:28:00', 4347, -27, 366),
