(437, 4347, 'Pagamento', 'Ma il pagamernto dei 300 euro avviene solamente ad operazione compiuta o ci sono altri requisiti?', '2017-05-16 13:38:00', 6, -23, 366),
(438, 6, 'RE: Pagamento', 'Buongiorno Francesco,\r\n         le riporto quanto indicato sul nostro sito web in merito:\r\nSe il tuo click risulter vincente, ovvero se il progetto da te inviato otterr lammissibilit al finanziamento dellINAIL, guadagnerai un compenso pari a 300,00 netti (che si concretizzano in un formale Contratto di Collaborazione da 375,00 lordi con ritenuta dacconto di legge).\r\n\r\nPer far si che il progetto da te inviato ottenga l\'ammissibilit al finanziamento, dovrai fare click nel pi breve tempo possibile, in quanto solo i progetti inviati per primi sul sito INAIL verranno ammessi al contributo.\r\n\r\nIl compenso di 300,00 netti sar erogato a seguito della pubblicazione degli elenchi dei progetti ammessi al contributo sul sito dellINAIL, presumibilmente una settimana dopo la data del Click Day\r\n\r\nSono inoltre previsti dei compensi speciali per i tre cliccatori pi veloci.\r\n\r\nSaluti Cordiali\r\nAlessandro', '2017-05-16 13:57:00', 4347, -27, 366),
