(512, 3697, 'RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Alessandro!\r\nSono Antonela Raciti, tempo fa ho caricato il contratto per il Click Day, ma dato pu essere inserita soltanto una pagina, ho mandato quella finale in cui vi  la mia firma.\r\nNon riesco a mandare il documento in un unico file!\r\nVa bene cosi?oppure mi consiglia un altro modo per caricarlo?\r\nGrazie.\r\nSaluti.\r\nAntonela.', '2017-05-23 12:22:00', 6, -23, 366),
