(514, 6, 'RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Gloria,\r\n         non si preoccupi, tutte le informazioni inerenti la procedura di invio e le istruzioni saranno comunque inviate a mezzo di posta elettronica, in molti non hanno un profilo facebook.\r\nRimango a disposizione.\r\nSaluti Cordiali\r\nAlessandro', '2017-05-23 13:18:00', 4811, -27, 366),
