(516, 3869, 'Informazioni', 'Buongiorno,\r\ncon la presente per avere informazioni su:\r\n- ho effettuato la registrazione il 3 maggio ma non ho ancora caricato il contratto firmato,  necessario farlo prima del Click Day?\r\n- il video tutorial quando verr inviato?\r\n- sono titolare di partita Iva nel caso dovessi essere selezionato emetter fattura di 375 euro pi iva + Contributo 4% Cassa di Previdenza, l\'intestazione committente  quella indicata da contratto?\r\n- infine se non risulto il pi veloce avr comunque comunicazione ?\r\nGrazie e cordiali saluti', '2017-05-23 15:07:00', 170, -3, -1),
(517, 170, 'RE: Informazioni', '\r\nBuonasera Sig. Francescantonio,\r\n\r\nrispondo ai quesiti posti:\r\n\r\n- il contratto  a sua tutela, pu firmarlo quando vuole \r\n- Il tutorial sar inviato appena lINAIL pubblicher le linee guida informatiche\r\n- Il 4%  compreso nei 375 euro\r\n- potr verificare lei stesso la sua performance dal sito dellINAIL quando verranno \r\n pubblicati i risultati.\r\n\r\nCordiali saluti', '2017-05-23 15:25:00', 3869, -24, 516),
