(521, 4850, 'Scopo del clickday', 'Salve\r\nda quello che ho letto, non si evince chiaramente lo scopo di questo evento, eccetto il fatto che serve per abbattere i costi sulla sicurezza del posto di lavoro e dei suoi dipendenti. Potrei avere delucidazioni a riguardo?\r\ngrazie', '2017-05-23 19:42:00', 170, -3, -1),
