(523, 186, 'Conferma iscrizione', 'Ciao Davide, manca la tua conferma d\'iscrizione. Quando ti sei registrato ti sarebbe dovvuta arrivare una mail con un link per confermare l\'iscrizione. Puoi controllare? \r\nGrazie!\r\nRaffaella', '2017-05-24 00:54:00', 3781, -24, -1),
(525, 170, 'RE: Scopo del clickday', 'Salve Angela,\r\n\r\nha letto tutte le informazioni presenti nella piattaforma?\r\n\r\nSaluti', '2017-05-24 08:41:00', 4850, -24, 521),
(526, 4862, 'contratto', 'Buongiorno, vorrei sapere se il contratto vi  arrivato in modo corretto.\r\n\r\nGrazie\r\nDaniela Meloni', '2017-05-24 08:54:00', 179, -3, -1),
(527, 179, 'RE: contratto', 'Buongiorno Sig.na Meloni, \r\n\r\nabbiamo ricevuto correttamente il suo contratto. \r\n\r\nLe auguro una buona giornata\r\n\r\nFabiola Saccani', '2017-05-24 09:00:00', 4862, -24, 526),
(528, 4862, 'RE: RE: contratto', 'Grazie.\r\nBuona giornata', '2017-05-24 09:28:00', 179, -22, 526),
(529, 4869, 'RE: AGGIORNAMENTI da Click Day 2017', 'Grazie mille per le info', '2017-05-24 10:09:00', 6, -23, 366),
(530, 4873, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'il contratto quindi va scaricato, stampato, scannerizzato e re-inviato a quale indirizzo? oppure c\' una procedura pi rapida e veloce? ciao e grazie', '2017-05-24 10:37:00', 6, -23, 114),
(531, 4597, 'RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno dovrei caricare il contratto firmato la il programma non lo prende, cosa devo fare? il file e\' in formato TIFF', '2017-05-24 11:03:00', 6, -23, 366),
(532, 4597, 'Invio contratto firmato', 'Buongiorno,\r\nil programma non mi prende il mio file in formato TIFF. perche?\r\nGrazie\r\nDI STEFANO', '2017-05-24 11:06:00', -1, -1, -1),
(533, 4877, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'dove sono i dati per inserire il bonifico?\r\npossibile contattarmi al 3477581812?\r\n', '2017-05-24 11:35:00', 6, -23, 114),
(534, 4877, 'info iban', 'volevo sapere quando e dove devo inserire iben per bonifico\r\n', '2017-05-24 11:37:00', 170, -3, -1),
(535, 6, 'RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Marisa, il suo contratto  caricato correttamente.\r\nSaluti Cordiali.\r\nAlessandro', '2017-05-24 12:12:00', 706, -27, 366),
(536, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Marco,\r\n          lo scarica gi compilato con i suoi dati dalla sua area riservata  poi, una volta firmato, lo ricarica  sempre dalla sua area riservata dall\'apposita funzione. Altrimenti pu inviarlo a info@clickdayats.it.\r\nRimango a disposizione.\r\nSaluti Cordiali.\r\nAlessandro', '2017-05-24 12:44:00', 4873, -27, 114),
(537, 6, 'RE: Invio contratto firmato', 'Buongiorno Paolo,  pu inviarlo in alternativa a info@clickdayats.it. Rimango a disposizione. Saluti Cordiali. Alessandro', '2017-05-24 12:45:00', 4597, -27, 532),
(538, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Daniele,\r\n                      i dati dell\'IBAN li richiederemo solo ai cliccatori che matureranno il compenso in modo da non richiedere dati personali eccedenti rispetto a quelli necessari. Una volta ultimata la procedura di invio e pubblicati dall\'INAIL  gli elenchi cronologici con le aziende ammesse a contributo sar nostra cura contattarvi per definire appunto le coordinate bancaria.  Le lascio comunque il numero del nostro centralino nel caso avesse dubbi in merito 0522/701079.\r\nRimango a disposizione. Saluti Cordiali. Alessandro', '2017-05-24 12:49:00', 4877, -27, 114),
(539, 4825, 'Invio contratto', 'Buon giorno, \r\nho inviato il contratto con 3 file diversi in quanto l\' ho caricato dal cellulare. Volevo avere gentilmente conferma che fosse tutto a posto. Grazie mille.\r\nCordialmente\r\nClaudia Berdusco', '2017-05-24 14:03:00', 178, -3, -1),
(540, 178, 'RE: informazioni sul contratto', 'Buonasera Tatiana,\r\n\r\nassolutamente no, nessun danno da risarcire in caso di mancato invio del codice.\r\n\r\nSaluti', '2017-05-24 16:52:00', 4339, -24, 519),
(541, 178, 'RE: Invio contratto', 'Buonasera Claudia,\r\n\r\ntutto a posto.\r\n\r\nSaluti', '2017-05-24 16:53:00', 4825, -24, 539),
(542, 4895, 'RE: AGGIORNAMENTI da Click Day 2017', 'letto compreso in attesa del clickday', '2017-05-24 20:56:00', 6, -23, 366),
(543, 4897, 'Attendo Istruzioni', 'Adesso che mi sono inscritto ed ho inviato il contratto firmato rimango in attesa di capire cosa devo fare . \r\nCordialmente Marco', '2017-05-24 22:07:00', 171, -3, -1),
(544, 4860, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'In caso di esito positivo del click day quando viene effettuato il pagamento?\r\nGrazie\r\nValeria', '2017-05-25 09:43:00', 6, -23, 114),
(545, 4916, 'RE: AGGIORNAMENTI da Click Day 2017', 'OK', '2017-05-25 10:29:00', 6, -23, 366),
(546, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Valeria,\r\n      alla domanda 6 trova la risposta alla sua domanda e altre informazioni:\r\nhttp://clickdayats.it/faq .\r\nRimango a disposizione.\r\nSaluti Cordiali.\r\nAlesssandro', '2017-05-25 10:30:00', 4860, -27, 114),
(547, 1266, 'RE: RE: RE: AGGIORNAMENTI da Click Day 2017', 'alessandro ho caricato il contratto..per favore fammi sapere se va bene..grazie', '2017-05-25 11:40:00', 6, -23, 366),
(548, 6, 'RE: RE: RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Vincenzo, confermo caricamento corretto del contratto. Saluti. Alessandro', '2017-05-25 11:48:00', 1266, -27, 366),
(549, 170, 'RE: info iban', 'Salve Daniele,\r\n\r\nle chiederemo noi le suo coordinate bancarie al momento dell\'eventuale pagamento.\r\n\r\nSaluti', '2017-05-25 12:26:00', 4877, -24, 534),
(550, 6, 'PROVA', 'PROVA', '2017-05-25 12:41:00', 164, -27, -1),
(551, 4964, 'INVIO CONTRATTO FIRMATO', 'SALVE, VI COMUNICO CHE IN DATA 25 MAGGIO 2017 HO INVIATO IL CONTATTO FIRMATO ED INVIATO DALLA PAGINA PERSONALE CON FILE ALLEGATO.', '2017-05-25 18:09:00', 197, -3, -1),
(552, 1257, 'RE: AGGIORNAMENTI da Click Day 2017', 'Ok', '2017-05-25 20:38:00', 6, -23, 366),
(553, 4981, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Quale contratto firmato dovrei mandare?', '2017-05-25 22:04:00', 6, -23, 114),
(554, 4919, 'contratto', 'Buongiorno,Vi ho inviato il contratto firmato ma non si riesce a caricare che una sola pagina pertanto ho accluso solo quella con la firma cio la terza.\r\nDitemi Voi se va bene.Grazie', '2017-05-26 06:41:00', 197, -3, -1),
(555, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Jessica,\r\n                  per sua tutela pu scaricare il contratto inerente questo progetto dalla sua area personale, firmarlo e ricaricarlo sempre dall\'area personale. Per una sua maggiore tutela.\r\nRimango a disposizione.\r\nSaluti Cordiali. Alessandro', '2017-05-26 07:40:00', 4981, -27, 114),
(556, 6, 'RE: contratto', 'Buongiorno Marco,\r\n                 confermo correttezza, la pagina firme andr bene. Grazie.\r\nSaluti Cordiali.\r\nAlessandro', '2017-05-26 07:50:00', 4919, -27, 554),
(557, 4919, 'RE: RE: contratto', 'grazie mille', '2017-05-26 08:22:00', 6, -23, 554),
(558, 4991, 'Caricamento contratto', 'Buongiorno,\r\nho riscontrato problemi nel caricare il contratto, l\'ho stampato e scansionato, riportato in formato pdf ma mi dice che si  verificato un errore e probabilmente il file selezionato non  corretto.\r\nGrazie per l\'attenzione\r\nEmanuela De Domenico', '2017-05-26 08:26:00', 197, -3, -1),
(559, 171, 'RE: Attendo Istruzioni', 'Salve,\r\ncertamente.\r\nEntro il 12 giugno vi invieremo tutorial e documenti che vi serviranno per capire come procedere con l\'inserimento.\r\nCordiali saluti ', '2017-05-26 09:30:00', 4897, -24, 543),
(560, 5000, 'Click Day Info', 'Salve, volevo chiedere se esiste un altro metodo di pagamento, visto che non sono in possesso di un conto bancario, grazie.', '2017-05-26 09:45:00', -1, -1, -1),
(561, 6, 'RE: Click Day Info', 'Buongiorno Giovanni,\r\n                 il compenso viene erogato solo ed esclusivamente a mezzo di bonifico bancario. Se pu tornarle utile pu indicare il conto di un suo familiare, poi per questi dovr firmare il contratto a suo nome per correttezza amministrativa.\r\nSaluti Cordiali\r\nAlessandro', '2017-05-26 10:13:00', 5000, -27, 560),
(562, 5000, 'RE: RE: Click Day Info', 'va bene, nel caso dovessi riuscirci potrei comunicare il conto di mia madre? Va bene?', '2017-05-26 10:52:00', 6, -23, 560),
(563, 5011, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'dove trovo il contratto?', '2017-05-26 11:26:00', 6, -23, 114),
(564, 6, 'RE: RE: RE: Click Day Info', 'Certamente,  dovr  contestualmente farci avere il contratto firmato da sua madre per regolarit.\r\nRimango a  disposizione.  Saluti. Alessandro', '2017-05-26 11:31:00', 5000, -27, 560),
(565, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Anuska,\r\n                       lo pu scaricare, gi precompilato con i suoi dati dalla sua are riservata.\r\nRimango a  disposizione. Saluti Cordiali. Alessandro', '2017-05-26 11:32:00', 5011, -27, 114),
(566, 5023, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Salve,  la prima volta che mi ritrovo a firmare un contratto quindi volevo chiarite alcune perplessit che possono sembrare anche banali:\r\nessendo una collaborazione, dopo il clickday il contratto mi scade e non sar legata a nessuno giusto?\r\ninoltre non va a incidere su contratti di lavoro che andr a stipulare o con il servizio civile, visto che per quest\'ultimo non bisogna aver stipulato contratti con altri?\r\nvi ringrazio in anticipo.', '2017-05-26 13:36:00', 6, -23, 114),
(567, 5000, 'RE: RE: RE: RE: Click Day Info', 'cambio solo la firma sul pdf o devo mettere nuove credenziali anche sul sito???', '2017-05-26 13:39:00', 6, -23, 560),
(568, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Francesca,\r\n                  il contratto  valido solo ed esclusivamente per l\'attivit d\'invio del codice progetto che vi forniremo che si concretizzer in una data che verr comunicata dall\'Ente INAIL a partire dal 12 giugno (si attester plausibilmente entro le due settimane successive).  L\'attivit durer 15 minuti concludendosi appunto quello stesso giorno. Per quanto riguarda il servizio civile purtroppo non possiamo risponderle non essendo a conoscenza della sua posizione fiscale  e delle normative di riferimento. Le consiglio di chiedere ai suoi Referenti per il Servizio Civile.\r\nRimango a disposizione. Saluti Cordiali. Alessandro', '2017-05-26 14:03:00', 5023, -27, 114),
(569, 6, 'RE: RE: RE: RE: RE: Click Day Info', 'Baster che compili il contratto con i dati della persona cui far capo l\'IBAN di riferimento e lo invii a info@clickdayats.it. Il contratto non compilato lo pu scaricare qui alla domanda 8: http://clickdayats.it/faq . Al momento dell\'eventuale erogazione del pagamento lo ricordi alla nostra amministrazione quando la contatter telefonicamente, grazie. Rimango a disposizione. Saluti Cordiali. Alessandro', '2017-05-26 14:08:00', 5000, -27, 560),
(570, 5023, 'RE: RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'in questo momento non lavoro e nemmeno svolgo il servizio civile.\r\nho chiesto questa informazione visto che fra qualche giorno verr pubblicato il bando per candidarsi.', '2017-05-26 14:12:00', 6, -23, 114),
(571, 5000, 'RE: RE: RE: RE: RE: RE: Click Day Info', 'ho caricato qui su il contratto con il nome e cognome di mia madre.', '2017-05-26 14:44:00', 6, -23, 560),
(572, 5072, 'registrazione effettuata', 'salve piacere mi chiamo Sebastiano ho 26 anni, ho appena effettuato la registrazione sul portale e ho caricato il contratto firmato, ora cosa devo fare?? grazie in anticipo..', '2017-05-27 09:17:00', 174, -3, -1),
(575, -1, 'Nuovo Utente Registrato ClickDay 2017', 'Un nuovo utente si  registrato come tuo referral. Il suo nome  Emanuele Pallotta. Adesso hai 1 referral.', '2017-05-27 14:31:00', 1006, -27, -1),
(576, -1, 'Nuovo Utente Registrato ClickDay 2017', 'Un nuovo utente si  registrato come tuo referral. Il suo nome  Giuseppe MADULI. Adesso hai 2 referral.', '2017-05-27 14:58:00', 1006, -27, -1),
(577, -1, 'Nuovo Utente Registrato ClickDay 2017', 'Un nuovo utente si  registrato come tuo referral. Il suo nome  Claudia Berardinucci. Adesso hai 3 referral.', '2017-05-27 15:07:00', 1006, -27, -1),
(578, -1, 'Nuovo Utente Registrato ClickDay 2017', 'Un nuovo utente si  registrato come tuo referral. Il suo nome  Diego Barca. Adesso hai 1 referral.', '2017-05-27 15:41:00', 4562, -27, -1),
(579, 4967, 'contratto firmato', 'Buonasera,\r\n\r\nsulla mia stampante non mi  possibile effettuare una scansione simultanea.\r\nVi ho allegato la terza pagina dove c\'e la firma sul contratto.\r\nSe ci sono problemi vi prego di avvisarmi\r\n\r\ngrazie', '2017-05-27 17:06:00', -1, -1, -1),
(580, -1, 'Nuovo Utente Registrato ClickDay 2017', 'Un nuovo utente si  registrato come tuo referral. Il suo nome  Silvia Alunni. Adesso hai 4 referral.', '2017-05-27 20:56:00', 1006, -27, -1),
(581, -1, 'Nuovo Utente Registrato ClickDay 2017', 'Un nuovo utente si  registrato come tuo referral. Il suo nome  MARIA ANTONELLA BRUNO. Adesso hai 2 referral.', '2017-05-27 22:02:00', 4562, -27, -1),
(582, 6, 'RE: contratto firmato', 'Buongiorno Francesco,\r\n           confermo correttezza, grazie.\r\nRimango a disposizione.\r\nSaluti Cordiali.\r\nAlessandro\r\n', '2017-05-28 08:47:00', 4967, -27, 579),
(585, 4804, 'RE: RE: RE: AGGIORNAMENTI da Click Day 2017', 'ciao alessandro devo mandarti il contratto firmato sono ancora in tempo?posso inviarlo in allegato a te qui?o sulla mail?fammi sapere grazie.', '2017-05-28 10:01:00', 6, -23, 366),
(586, 6, 'RE: RE: RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Mariano,\r\n           pu caricarlo nell\'apposito campo accedendo al suo profilo oppure inviarlo in allegato a info@clickdayats.it.\r\nSaluti Cordiali.\r\nAlessandro', '2017-05-28 13:33:00', 4804, -27, 366),
(587, 4562, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Cos\' lo Screenshot ?', '2017-05-28 15:20:00', 6, -23, 114),
(588, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Stefano,\r\n                    lo screenshot sar la stampa/fotografia della schermata video da effettuare alla fine della procedura di invio del codice progetto (con il tempo di invio). Ma non si preoccupi, vi invieremo ulteriori informazioni e un semplice video tutorial che vi spiegher la procedura.\r\nRimango a disposizione. Saluti Cordiali. Alessandro.', '2017-05-28 15:40:00', 4562, -27, 114),
(589, 4689, 'domande su click day', 'Salve ho  due domande da farvi ,per entrare nel sito dell\'inail ci vuole una password ce l \'ha fornite voi? Il codice alfanumerico  che dovremo inserire ce  l\'ho fornite qualche giorno prima del click day o il giorno stesso? Spero qualche giorno prima cosi l\'ho memorizziamo meglio.Cordiali saluti.', '2017-05-28 15:42:00', 169, -3, -1),
(590, 4981, 'RE: RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Ok perfetto, ho scaricato il contratto. Le chiedo gentilmente se pu spiegarmi meglio tutto ci, in quanto non l\'ho mai fatto. La ringrazio in anticipo per la sua risposta. \r\nCordiali saluti.', '2017-05-28 22:31:00', 6, -23, 114),
(591, 140, 'Novit?', 'C\' qualche novit sul click day? Si sa indicativamente la data e l\'orario. Vorrei riuscire ad organizzarmi.\r\nGrazie', '2017-05-29 05:43:00', -1, -1, -1),
(592, 169, 'RE: domande su click day', 'il portale per le aziende del clickday  ovviamente protetto.\r\nil codice del tuo progetto di verr (come giustamente osservavi) spedito un paio di giorni prima del clickday - come anche un video tutorial per capire al meglio la procedura che via attender!\r\nPaolo', '2017-05-29 09:32:00', 4689, -24, 589),
(593, -1, 'Nuovo Utente Registrato ClickDay 2017', 'Un nuovo utente si  registrato come tuo referral. Il suo nome  Marilina Notarangelo. Adesso hai 5 referral.', '2017-05-29 10:03:00', 1006, -27, -1),
(594, 6, 'RE: RE: RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Jessica,\r\n               non si preoccupi vi invieremo informazioni in merito ed un video tutorial molto semplice che vi spiegher la procedura di invio del codice progetto. Comunque trova qui tutto l\'iter e la risposta a molte domande nella sezione FAQ: http://clickdayats.it/ .\r\nRimango a disposizione. Saluti Cordiali. Alessandro', '2017-05-29 10:12:00', 4981, -27, 114),
(595, 6, 'RE: Novit?', 'Buongiorno Federica,\r\n       l\'Ente INAIL comunicher la data a partire dal 12 giugno 2017 e si attester presumibilmente nell\'arco delle  2  settimane successive. Sar nostra cura mantenervi aggiornati.\r\nSaluti Cordiali. Alessandro', '2017-05-29 10:13:00', 140, -27, 591),
(596, -1, 'Nuovo Utente Registrato ClickDay 2017', 'Un nuovo utente si  registrato come tuo referral. Il suo nome  GIANLUCA MACCHI. Adesso hai 1 referral.', '2017-05-29 10:52:00', 4954, -27, -1),
(597, 245, 'Clickday', 'Volevo chiederle se tutti coloro che invieranno correttamente il progetto assegnatoci percepiranno il compenso di 350 euro ( a prescindere dai primi tre click pi veloci).\r\nCordiali Saluti', '2017-05-29 11:10:00', 6, -23, 366),
(598, 5150, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno.\r\nNel caso non fossi disponibile il giorno indicato incorro in qualche sanzione? E nel caso in cui non riuscissi ad inviare telematicamente a causa di un elevato numero di utenti connessi?\r\nGrazie', '2017-05-29 12:06:00', 6, -23, 114),
(599, 5153, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'sto cercando di inviare il contratto firmato ... non so se  gi arrivato o probabilmente sbaglio qualcosa', '2017-05-29 12:27:00', 6, -23, 114),
(602, 6, 'RE: non voglio partecipare al click day', 'Buongiorno Carmine,\r\n           provvediamo immediatamente alla cancellazione del suo account e dei suoi dati.\r\nSaluti Cordiali .\r\nAlessandro', '2017-05-29 12:40:00', 4849, -27, 600),
(603, 6, 'RE: Clickday', 'Buongiorno Ambra,\r\n          il compenso  pari a 375 euro lordi con ritenuta d\'acconto di legge per un netto di euro 300. Il compenso matura se il codice progetto a lei assegnato verr inviato in tempo utile all\'ottenimento del contributo per l\'azienda a cui corrisponde; il tutto verificabile sul portale INAIL appena pubblicheranno gli elenchi cronologici entro una settimana dal clickday.\r\nQui trova molte informazioni: http://clickdayats.it/##comeGuadagni\r\n\r\nRimango a disposizione\r\nSaluti Cordiali\r\nAlessandro', '2017-05-29 12:43:00', 245, -27, 366),
(604, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Simona,\r\n            il suo contratto  caricato regolarmente; non ha alcun obbligo di prestazione. Le chiediamo solo la cortesia, nel caso non riuscisse,  di comunicarcelo con un po\' di anticipo. Saluti Cordiali. Alessandro', '2017-05-29 12:46:00', 5153, -27, 114),
(605, 5160, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Ok vi ringrazio!', '2017-05-29 13:18:00', 6, -23, 114),
(606, -1, 'Nuovo Utente Registrato ClickDay 2017', 'Un nuovo utente si  registrato come tuo referral. Il suo nome  Martina Sbraga. Adesso hai 6 referral.', '2017-05-29 13:24:00', 1006, -27, -1),
(608, 3572, 'appunti seconda pag contratto', 'Ho caricato, come richiesto, il contratto \"clickday\"; evidenzio che la seconda pagina, in calce, sembra essere incompleta nel testo in quanto recita: \"... e vigilanza nonch alla corretta; ...\" e non prosegue oltre. Resto in attesa Vs. riscontro. Grazie. Cordiali saluti.  Francesco Martucci.', '2017-05-29 13:57:00', 178, -3, -1),
(609, 178, 'RE: appunti seconda pag contratto', 'Ha ragione, ho controllato e quello  un refuso che andava eliminato. Nessun problema comunque.\r\n\r\nSaluti', '2017-05-29 14:06:00', 3572, -24, 608),
(610, 4556, 'RE: AGGIORNAMENTI da Click Day 2017', 'Gentilissimo, ho visionato il contratto ma ti segnalo che sono titolare di partita iva..... quindi dovremmo modificare il contratto indicandola..... attendo feedback.\r\nps il mio n. di partita iva  01628710897', '2017-05-29 14:39:00', 6, -23, 366);
INSERT INTO `mails` (`ID`, `mittID`, `title`, `content`, `time`, `destID`, `type`, `parentID`) VALUES
(611, 6, 'RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Gabriele,\r\n                   essendo possessore di p.IVA  non avrebbe nemmeno bisogno del contratto. Lo firmi e lo mandi per una sua tutela, poi anzich erogare il compenso con ritenuta d\'acconto calcolata sui 375 euro (quindi 300 netti).  Emetter una fattura da euro 375 + IVA ad ATS   CONSULENTI ASSOCIATI s.r.l. - via J.F. Kennedy, 17 - 42124 Reggio nellEmilia  c.f. e p.iva reg. impr. RE 01645400357.\r\nRimango a disposizione. Saluti Cordiali. Alessandro\r\n', '2017-05-29 15:09:00', 4556, -27, 366),
(612, 4556, 'RE: RE: RE: AGGIORNAMENTI da Click Day 2017', 'ok chiaro, a presto', '2017-05-29 15:10:00', 6, -23, 366),
