(614, 5197, 'codice click', 'Buonasera. In fase di inserimento mi  stato chiesto di indicare se ero in possesso di codice clickmaster (che non avevo). Ho proseguito pensando che mi venisse assegnato successivamente ma non ho notato nessun codice. Chiedo se mi deve essere assegnato o meno. Grazie', '2017-05-29 18:08:00', -1, -1, -1),
