(625, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Francesco,\r\n          presto vi invieremo informazioni in merito alla procedura di invio del codice progetto  ed un video tutorial molto semplice . Intanto qui trova tutte le informazioni sul progetto: http://clickdayats.it/ . Nella sezione FAQ molte risposte alle domande pi ricorrenti. Rimango a disposizione. Saluti Cordiali. Alessandro', '2017-05-30 10:51:00', 5243, -27, 114),
(627, 5270, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Salve,vorrei segnalare che una volta scaricato il contratto in quest\'ultimo compaiono errori nei dati personali, come se non li avesse registrati in fase di inserimento. Grazie.', '2017-05-30 16:06:00', 6, -23, 114),
(628, 5235, 'screenshot', 'Salve,vorrei sapere cosa, devo mettere nello screenshot?\r\nUn\' altra cosa,il cap nei dati personali non lo scrve per intero,ho provato a correggere,ma non me lo fa fare.Ringrazio anticipatamente', '2017-05-30 16:17:00', -1, -1, -1),
