(630, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Giovanni,\r\n              grazie per la segnalazione, sappiamo che si verifica in alcuni casi  a  causa di impostazioni proprie del browser. Andr bene comunque la terza pagina con le firme. \r\nRimango a disposizione. Saluti Cordiali. Alessandro.', '2017-05-30 16:20:00', 5270, -27, 114),
(631, 6, 'RE: screenshot', 'Buongiorno Maria Teresa, lo screenshot  parte integrante della procedura di invio del codice progetto, ad oggi non dovr fare nulla in merito.Seguiranno  informazioni ed un video tutorial molto semplice che vi spiegher la procedura di invio e come operare con lo screenshot. Per l\'errore del  CAP nessun problema.\r\nRimango a disposizione. Saluti Cordiali. Alessandro', '2017-05-30 16:22:00', 5235, -27, 628),
(632, 6, 'RE: RE: RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Mohammad,\r\n                     presto vi invieremo un video tutorial molto semplice che vi spiegher tutta la procedura di invio del codice progetto.  Qui trova molte risposte: http://clickdayats.it/faq . \r\nSaluti Cordiali\r\nAlessandro', '2017-05-30 16:23:00', 1239, -27, 366),
(633, 5271, 'Problema download contratto', 'Buongiorno!\r\nIl download del contratto non va a buon fine, poich quando apro il file ottengo al posto dei campi da compilare una serie di errori php, come da screenshot che ho inserito nell\'area riservata. Posso riceverlo come allegato?\r\nHo provato a cambiare browser ma senza successo.\r\nGrazie in ogni caso\r\nAlice Sabato', '2017-05-30 16:40:00', 171, -3, -1),
(634, 5279, 'impossibilit a scaricare contratto', 'non mi   possibile scaricare il contratto. viene riportato il seguente messaggio.\r\nA PHP Error was encountered. Attendo istruzioni. Grazie', '2017-05-30 17:29:00', -1, -1, -1),
