(636, 5284, 'ERRORE NEL CONTRATTO', 'Salve, ho scaricato il contratto per stamparlo ma non contiene i miei dati, riporta invece dei codici di errore. Potete risolvere? Grazie mille, Davide', '2017-05-30 18:49:00', -1, -1, -1),
(637, 5288, 'contratto da scaricare', 'Salve,sto provando a scaricare il contratto da firmare,ma quando apro il file pdf mi escono i miei dati sottoforma di codici di errore.Come posso risolvere?Grazie.', '2017-05-30 20:57:00', 197, -3, -1),
