(656, 6, 'RE: RE: RE: MODIFICA', 'Presto vi invieremo informazioni in merito alla procedura di invio ed un video tutorial, molto semplice, che definir il tutto nel dettaglio.  Nel frattempo la invito a visitare il nostro portale dove trover molte risposte: http://clickdayats.it/##comeFunziona.\r\nRimango a disposizione. Saluti Cordiali. Alessandro', '2017-05-31 15:25:00', 5344, -27, 652),
(657, 5369, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Salve volevo sapere che screenshot dovrei fare sotto i pulsanti del download/upload contratto dove c\' appunto il pulsante carica screenshot. grazie ', '2017-05-31 17:28:00', 6, -23, 114),
(658, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buonasera Alessio,\r\n              lo screenshot sar da effettuarsi nella fase finale della procedura di invio del codice progetto quando comparir la ricevuta dell\'INAIL con la presa in carico della domanda. Non si preoccupi, seguiranno informazioni in merito ed un semplice  video tutorial che spiegher l\'intera procedura. Rimango a disposizione. Saluti Cordiali. Alessandro', '2017-05-31 17:37:00', 5369, -27, 114),
(659, 5369, 'RE: RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Un ultima domanda un p \"banale\": nel contratto non ho capito molto bene; devo pagare o chiedere qualcosa a pagamento per aderire completamente al clickday?\r\nBuona serata', '2017-05-31 17:38:00', 6, -23, 114),
(660, 6, 'RE: RE: RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Alessio,\r\n                       assolutamente no, se il suo click sar abbastanza veloce da rientrare negli elenchi cronologici INAIL per l\'ammissione al contributo  ricever un compenso di 300 euro (375 lordi con ritenuta d\'acconto) e nel caso rientrasse fra i tre cliccatori pi veloci  sono previsti compensi di 4.500, 2.500 e  1.500 euro.  Non  nemmeno obbligato ad effettuare il click, nel caso per non ce la facesse, le chiediamo solo di avvertirci preventivante. Grazie. Saluti Cordiali. Alessandro', '2017-06-01 07:02:00', 5369, -27, 114),
(661, 5326, 'Incongruenze FAQ - Contratto', 'Salve, ieri mi sono iscritta al sito e ho scaricato il contratto. Prima di firmarlo per, volevo chiedere delucidazioni riguardo due questioni: la prima riguarda il pagamento, poich sul contratto c\' scritto che verr effettuato successivamente la classifica dei click utili ma non  indicato un termine massimo. La seconda questione riguarda l\'inadempienza del contratto: cosa succede se al momento dell\'inserimento del codice la connessione fosse lenta/la pagina sovraccaricata/computer non funzionante ecc? Tra le FAQ ho letto che non succede niente, per non ho trovato la stessa cosa sul contratto anzi, riporta \"9. Tutte le clausole del presente atto sono da intendersi essenziali ed inderogabili, talch linosservanza di anche una sola di esse produrr ipso iure la risoluzione del contratto, con obbligo del risarcimento dei danni a carico della parte che si sar resa inadempiente; \" . Vorrei gentilmente dei chiarimenti riguardo questa \"inadempienza\" e mi chiedevo perch trovo risposta a queste due questioni solo tra le FAQ e non anche del contratto;  quindi possibile modificarlo, inserendo queste due clausule?  Vi ringrazio. Chiara Leoni', '2017-06-01 08:33:00', 170, -3, -1),
(662, 5398, 'RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno.\r\nSe nel giorno del Click day fossi per caso impegnata e non potessi procedere,  sufficiente che vi invii comunicazione via pec? Vi sono dei tempi da rispettare? In tal caso non sarei considerata \"inadempiente\": ho infatti letto nel contratto che la parte inadempiente sarebbe tenuta a risarcire i danni.\r\nE in caso che non riuscissi ad effettuare l\'invio il giorno stesso, ne potrei rispondere?\r\nGrazie.\r\nIn attesa di chiarimenti, porgo cordiali saluti.\r\nChiara', '2017-06-01 08:56:00', 6, -23, 366),
(663, 327, 'Iscritto con p. IVA', 'Buongiorno, ho caricato il contratto datato e firmato. Io per sono in possesso di partita IVA e fatturo con il vecchio regime dei minimi (senza ritenuta d\'acconto). \r\nDevo comunicare qualcosa adesso?', '2017-06-01 09:25:00', -1, -1, -1),
(664, 6, 'RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Chiara,\r\n          il contratto al punto 6 prevede semplicemente che in caso non riusciate a partecipare baster inviarci una email: \"Il prestatore potr recedere in qualsiasi momento dal presente contratto a mezzo di semplice comunicazione tramite posta elettronica. \" Basta che ce lo comunichi un paio di giorni prima dalla data del clickday che ancora attendiamo, in modo da poterci organizzare. Nel caso vi fossero malfunzonamenti purtroppo, essendo un portale  pubblico INAIL quello da cui invieremo i codici progetto , se si verificassero dei malfunzionamenti non dipenderebbe da noi.\r\nRimango a disposizione.\r\nSaluti Cordiali\r\nAlessandro', '2017-06-01 09:30:00', 5398, -27, 366),
(665, 6, 'RE: Iscritto con p. IVA', 'Buongiorno Rodolfo,\r\n           nessuna comunicazione particolare, semplicemente emetter fattura in base al suo regime con un imponibile paria 375 in caso di esito positivo. Rimango a disposizione.\r\nSaluti Cordiali. Alessandro', '2017-06-01 09:31:00', 327, -27, 663),
(666, 5414, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'in relazione ai metodi per essere pi veloce da quanto ho capito leggendomi la procedura come prima cosa necessita tassativamente avere l\'orario ufficiale dell\'inal sulla procedura del click day altrimenti tutto il lavoro si rende vano potreste darmi dei consigli per sincronizzare l\'orologio del mio pc a quello ufficiale dell\'inail sulla procedura del click day.', '2017-06-01 11:19:00', 6, -23, 114),
(667, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Luciano,\r\n        non si preoccupi in merito, seguiranno informazioni e soprattutto un video tutorial molto semplice che spiegher tutta la procedura di invio.\r\nRimango a disposizione.\r\nSaluti Cordiali. Alessandro', '2017-06-01 12:24:00', 5414, -27, 114),
(668, 5020, 'Contratto', 'Salve, ho inviato il contratto firmato attraverso lo smartphone ieri sera, ed ho incontrato alcuni problemi. Vorrei essere certo che vi sia arrivato firmato. Potete controllare per favore?', '2017-06-01 13:59:00', -1, -1, -1),
