(671, 6, 'RE: RE: RE: RE: RE: MODIFICA', 'Buongiorno Omar,\r\n              il video tutorial sar pronto non appena l\'INAIL pubblicher le linee guida informatiche per la procedura di invio. Difficilmente prima del 10 di giugno.\r\nRimango a disposizione\r\nSaluti Cordiali\r\nAlessandro', '2017-06-01 14:42:00', 5344, -27, 652),
