(673, 5459, 'RE: AGGIORNAMENTI da Click Day 2017', 'Salve, avrei delle domande. Rispetto al compenso, verr erogato solo e nel caso dovessimo inviare il click nel pi breve tempo possibile oppure c\' un margine pi ampio?\r\nvorrei delle delucidazioni, quando si ottengono le 300 euro  e quando eventualmente un compenso pi alto? grazie, Patrizia', '2017-06-02 08:22:00', 6, -23, 366),
(674, 6, 'RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Stefania,\r\n          presto vi invieremo informazioni in merito alla procedura di invio ed un video tutorial, molto semplice, che definir il tutto nel dettaglio. Nel frattempo la invito a visitare il nostro portale dove trover molte risposte: http://clickdayats.it/##comeFunziona. Rimango a disposizione. Saluti Cordiali. Alessandro', '2017-06-02 10:08:00', 5437, -27, 366),
(675, 6, 'RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Patrizia,\r\n           il compenso verr erogato se il codice progetto a lei assegnato sar inviato in tempo utile per far ottenere il contributo INAIL all\'azienda cui  associato.  Gli elenchi cronologici con i tempi di invio e le aziende ammesse a contributo saranno pubblicati dall\'INAIL sul  suo sito web entro 7 gironi dalla data del clickday. La invito a visitare il nostro portale, trover molte risposte utili: http://clickdayats.it/faq . \r\nSeguiranno comunque informazioni in merito ed un video tutorial molto semplice con la procedura di invio. Rimango a disposizione. Saluti Cordiali. Alessandro', '2017-06-02 10:15:00', 5459, -27, 366),
(676, 5015, 'Recesso contratto di prestazione di servizio ', 'Buongiorno Signor Ferretti,\r\nper motivi personali recedo dal contratto di prestazione di servizio sottoscritto e datato  27.05.17  relativo all\'invio telematico delle domande di richiesta contributo relative al bando ISI INAIL 2016 e allegato al vostro sito.\r\nCordiali saluti.\r\nMarcella Sassolini', '2017-06-02 15:43:00', 178, -3, -1),
