(710, 6, 'RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Domenico,\r\n           certamente che lo .  A comprova pu verificare autonomamente sul sito web dell\'Ente Pubblico INAIL il funzionamento di questo BANDO, a seguito il link:\r\nhttps://www.inail.it/cs/internet/attivita/prevenzione-e-sicurezza/agevolazioni-e-finanziamenti/incentivi-alle-imprese/bando-isi-2016.html . \r\n\r\nRimango a disposizione. Saluti Cordiali. Alessandro', '2017-06-06 07:52:00', 5625, -27, 366),
