(712, 5641, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno,\r\nIo ho un problema sul caricamento del contratto. Ho fatto la scannerizzazione e creato il PDF ma al momento del caricamento mi dice \"Si  verificato un errore inaspettato, probabilmente il file selezionato non  corretto\". Cosa devo fare?\r\nGrazie.\r\nCordiali saluti,\r\n\r\nBerton Elena', '2017-06-06 08:10:00', 6, -23, 114),
