(714, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Elena,\r\n              a volte con browser non aggiornati all\'ultima versione si verificano problemi simili. Lo mandi pure a info@clickdayats.it, provvederemo a risponderle con la conferma di presa in carico. Grazie. Rimango a disposizione. Saluti Cordiali. Alessandro', '2017-06-06 08:39:00', 5641, -27, 114),
(715, 5625, 'RE: RE: RE: AGGIORNAMENTI da Click Day 2017', 'io dicevo questa cosa che dobbiamo fare noi se  legale oppure no...volevo chiederle ancora ma nel contratto che vado a firmare sono previsti anche contributi per la pensione o semplicemente solo la retribuzione?', '2017-06-06 08:42:00', 6, -23, 366),
(716, 6, 'RE: RE: RE: RE: AGGIORNAMENTI da Click Day 2017', 'Ribadisco,  assolutamente legale, sia l\'attivit, sia la contrattualistica per i cliccatori ovviamente. Si tratta di un contratto di collaborazione occasionale con ritenuta d\'acconto di legge  pari a 375 euro lordi (ritenuta da noi versata di euro 75). Il contratto  pubblicato e fruibile dal nostro portale web  per qualunque utente. \r\nLa invito a visitare la nostra piattaforma, attiva da tre anni, e la nostra pagina facebook.\r\nhttp://clickdayats.it/ . \r\nhttps://www.facebook.com/clickday .\r\n\r\nSaluti Cordiali\r\nAlessandro', '2017-06-06 09:14:00', 5625, -27, 366),
(717, 5407, 'RE: AGGIORNAMENTI da Click Day 2017', 'e\' possibile avere il video tutorial per poter vedere come funziona il tutto . grazie anticipatamente', '2017-06-06 09:47:00', 6, -23, 366),
(718, 6, 'RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Mario,\r\n           siamo in attesa della pubblicazione delle Regole Tecniche INAIL per l\'invio informatico dei codici che avverr entro il 12 giugno. Appena saranno pubblicate vi invieremo le istruzioni relative ed un video tutorial molto semplice con la procedura. Poi a partire dal 12 giugno sempre l\'Ente INAIL comunicher la data del clickday che si attester probabilmente entro le due settimane successive.\r\n\r\nRimango a disposizione.\r\nSaluti Cordiali\r\nAlessandro\r\n', '2017-06-06 10:01:00', 5407, -27, 366),
(719, 1142, 'RE: Conferma Registrazione', 'Ciao Chiara,\r\ntutto bene. Pensavo di aver confermato. Riesci cortesemente a verificarlo?\r\nHo provato sia a cliccare sull\'attivazione che a copiare l\'URL ma mi da errore.\r\n\r\nUn saluto e a prestissimo.\r\n\r\nAndrea', '2017-06-06 10:09:00', 181, -22, 697),
