(728, 6, 'RE: ISCRIZIONE MINORENNE', 'Buongiorno Stefania,\r\n            se sua figlia ha gi compiuto i 16 anni pu iscriversi regolarmente. Nel caso maturasse il compenso mi ricordi di contattare lei personalmente in modo che il pagamento sia sotto il suo \"controllo\". Se avesse dubbi in merito non esiti a contattarci anche telefonicamente allo 0522/701079. Rimango a disposizione. Saluti Cordiali. Alessandro', '2017-06-06 13:22:00', 5666, -27, 725),
(729, 170, 'RE: novit', 'Salve Aishe,\r\n\r\nora deve attendere la comunicazione della data e oraro esatti del Click Day.\r\n\r\nRicever una mail a partire dal 12 di giugno.\r\n\r\nSaluti', '2017-06-06 13:28:00', 5404, -24, 707),
(730, 6, 'RE: RE: RE: RE: AGGIORNAMENTI da Click Day 2017', 'Buongiorno Marco,\r\n          il compenso viene erogato nel caso in cui linvio telematico del codice progetto  che vi forniremo sia abbastanza veloce  da far ottenere all\'azienda cui  associata questo codice il posizionamento utile negli elenchi cronologici INAIL per l\'ottenimento del contributo. Trova i dettagli sia nel contratto all\'art. 5.1 sia sul nostro portale http://clickdayats.it/##comeFunziona . Rimango a disposizione. Saluti Cordiali. Alessandro\r\n', '2017-06-06 13:36:00', 5658, -27, 366),
(731, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Isidoro,\r\n           siamo in attesa della pubblicazione delle Regole Tecniche INAIL per l\'invio informatico dei codici che avverr entro il 12 giugno. Appena saranno pubblicate vi invieremo le istruzioni relative ed un video tutorial molto semplice con la procedura. Poi a partire dal 12 giugno sempre l\'Ente INAIL comunicher la data del clickday che si attester probabilmente entro le due settimane successive.\r\n\r\nRimango a disposizione.\r\nSaluti Cordiali\r\nAlessandro', '2017-06-06 13:38:00', 5676, -27, 114),
(732, 1288, 'RE: RE: Contratto', 'Ciao,\r\nma ci sono vincoli se per caso non riuscissi a partecipare quel giorno a quell\'ora stabilita? Nel contratto leggo di una raccomandata da inviare in caso di recesso.', '2017-06-06 14:52:00', 6, -23, 711),
(733, 6, 'RE: RE: RE: Contratto', 'Buongiorno Giuseppe,\r\n                 le confermo che non ha alcun obbligo di prestazione,  le chiediamo semplicemente, anche a mezzo di posta elettronica, di comunicarci preventivamente  la sua impossibilit nell\'effettuare la prestazione in modo da poterci organizzare.\r\nQui trova comunque la risposta alla sua domanda (e la n. 12):  http://clickdayats.it/faq . \r\nSaluti Cordiali. Alessandro ', '2017-06-06 15:10:00', 1288, -27, 711),
