(735, 1288, 'RE: RE: RE: RE: Contratto', 'Grazie mille tutto chiaro. Ho altre due domande che non ho trovato tra le faq.\r\n\r\n1) per l\'eventuale compenso dovr comunicarvi un Iban, quando dovr essere comunicato? \r\n2) ho letto che il contratto doveva essere firmato e caricato entro 5 giorni dalla data di iscrizione al sito, tuttavia l\'ho fatto oggi dopo quasi un mese, ci sono problemi?\r\n\r\nGrazie', '2017-06-06 15:17:00', 6, -23, 711),
(736, 6, 'RE: ClickMaster', 'Buongiorno Rossana,\r\n             sar mia cura rispondere a qualunque sua richiesta di informazione . \r\nAd oggi siamo in attesa della pubblicazione delle Regole Tecniche INAIL per l\'invio informatico dei codici che avverr entro il 12 giugno. Appena saranno pubblicate vi invieremo le istruzioni relative ed un video tutorial molto semplice con la procedura. Poi a partire dal 12 giugno sempre l\'Ente INAIL comunicher la data del clickday che si attester probabilmente entro le due settimane successive.\r\nRimango a disposizione.\r\nSaluti Cordiali\r\nAlessandro', '2017-06-06 15:20:00', 5387, -27, 734),
(737, 6, 'RE: RE: RE: RE: RE: Contratto', 'L\'IBAN lo richiederemo soltanto a coloro che avranno maturato il compenso in modo da non richiedere dati eccedenti rispetto a quelli necessari a questa prima fase. Pubblicheremo i risultati all\'interno dell\'area riservata e voi, in autonomia, potrete verificarli sul sito web dell\'Ente INAIL. Il contratto  pu tranquillamente inviarlo appena avr tempo, possibilmente entro il 12 giugno.\r\nRimango a disposizione. Saluti Cordiali.\r\nAlessandro', '2017-06-06 15:25:00', 1288, -27, 711),
