(760, 6, 'RE: richiesta informazioni', 'Buongiorno Valerio,\r\n        un BANDO indetto dall\'Ente INAIL, alla sua settima edizione, che concede contributi alle aziende per il miglioramento delle condizione di salute e sicurezza dei lavoratori. Il nostro Studio si occupa della presentazione di tali progetti, sia dal punto amministrativo sia tecnico, a seguito appunto del clickday, cio la procedura pubblicata dall\'INAIL per l\'assegnazione dei contributi. Si tratter di inviare\r\nun codice progetto che noi vi assegneremo, il pi velocemente possibile, in una data ed un orario esatto che l\'INAIL comunicher il 12 giugno 2017.\r\nSeguiranno nostre comunicazioni ed un video tutorial molto semplice che spiegher la procedura di invio del codice progetto. Qui trova comunque molte informazioni (domande e risposte): http://clickdayats.it/faq\r\nQui altre ancora: http://clickdayats.it/##comeFunziona\r\n\r\nRimango a disposizione.\r\nSaluti Cordiali.\r\nAlessandro\r\n', '2017-06-07 14:44:00', 5770, -27, 759),
(761, 6, 'SUO CONTRATTO per CLICKDAYATS', 'Buongiorno Michele,\r\n         le chiedo la cortesia di inviarci, nel caso fosse interessato al progetto,  il contratto firmato. Pu caricarlo dalla sua area riservata dall\'apposito campo.\r\nRimango a disposizione. Saluti Cordiali. Alessandro', '2017-06-07 15:28:00', 3919, -27, -1),
