(763, 5553, 'Informazione', 'Salve desidero sapere  se  necessario caricare il contratto, perch nel caso fosse necessario caricarlo in pdf non riesco ne ad aprirlo ne modificarlo percui se potreste inviarlo in word via mail sarebbe per me molto pi semplice grazie ancora. .', '2017-06-07 23:02:00', 179, -3, -1),
(764, 179, 'RE: Informazione', 'Buongiorno Sig.ra Bertini, \r\nil contratto lo pu trovare al seguente link http://clickdayats.it/faq alla domanda/risposta 8. \r\n\r\nCordiali Saluti \r\n\r\nFabiola Saccani', '2017-06-08 07:07:00', 5553, -24, 763),
(765, 4515, 'RE: RE: contratto firmato', 'salve,\r\nho caricato il contratto.\r\nquando sar il click day? si sa gi?', '2017-06-08 07:30:00', 6, -23, 640),
(766, 6, 'RE: RE: RE: contratto firmato', 'Buongiorno Michele,\r\n           siamo in attesa della pubblicazione delle Regole Tecniche INAIL per l\'invio informatico dei codici che avverr entro il 12 giugno. Appena saranno pubblicate vi invieremo le istruzioni relative ed un video tutorial molto semplice con la procedura. Poi a partire dal 12 giugno sempre l\'Ente INAIL comunicher la data del clickday che si attester probabilmente entro le due settimane successive.\r\n\r\nRimango a disposizione.\r\nSaluti Cordiali\r\nAlessandro\r\n', '2017-06-08 07:48:00', 4515, -27, 640),
(767, 4515, 'RE: RE: RE: RE: contratto firmato', 'Grazie mille Alessandro,\r\nspero che non sia l\'ultima settimana di giugno perch sar in viaggio....\r\nsaluti\r\nbuon lavoro\r\nMichele', '2017-06-08 07:50:00', 6, -23, 640),
(768, 5871, 'info', 'm dove lo trovo il contratto?', '2017-06-08 08:09:00', 171, -3, -1),
(769, 5543, 'Info Preparazione per il Click day', 'Salve,\r\ndopo la mia iscrizione al vostro click day volevo ricevere delle info e se possibile dei video dove verificare l\'attivita\' da svolgere dal giorno 12-06.\r\nVi ringrazio e resto in attesa di  una vostra risposta. \r\nDistinti saluti\r\nDanilo S', '2017-06-08 08:16:00', 174, -3, -1),
(770, 171, 'RE: info', 'Buongiorno, All\'interno della pagina dove si  iscritta.\r\nall\'interno nella sezione a sinistra.', '2017-06-08 08:20:00', 5871, -24, 768),
(771, 6, 'Aggiornamenti da click day!', 'Caro Cliccatore, il 12 giugno  alle porte! A partire da luned prossimo infatti l\'INAIL comunicher la data e l\'ora esatta del Click Day! Appena lo far, ti scriveremo per comunicarla anche a te (via email e sulla nostra pagina FB). Nel frattempo due informazioni utili: 1) Presto sar pronto il Video Tutorial molto semplice con la procedura di invio del codice progetto, che ti manderemo tramite email qualche giorno prima del click day e naturalmente sar fruibile anche dalla piattaforma - 2) La prossima settimana ti invieremo il tuo CODICE PROGETTO . Il Codice progetto  il codice alfanumerico che dovrai copiare e incollare sul portale INAIL il giorno del Click Day; FAI ATTENZIONE al simbolo + o -  posto allinizio della stringa di codice perch  parte integrante del codice stesso! Senza quel + o - il tuo codice risulter errato e quindi anche il tuo click! A presto! Lo Staff Click Day', '2017-06-08 08:38:00', -1, -15, -1),
(772, 170, 'RE:  contratto', 'Ottimo Ivana.\r\n\r\nCordiali', '2017-06-08 08:44:00', 5839, -24, 762),
(773, 4284, 'RE: Aggiornamenti da click day!', 'Grazie per l\'aggiornamento.  A presto!', '2017-06-08 08:52:00', 6, -23, 771),
