(775, 3998, ' Aggiornamenti da click day!_Antonio Giammario', 'Alessandro b.giorno,\r\ngrazie e  tutto perfetto e speriamo bene.\r\nSolo una domanda.\r\nE\' una O o uno zero quello vicino al +? e le virgolette non sono da mettere?\r\nGrazie.\r\nAttendo riscontro e star attento a tutto e attendo il video e prendo aggiornamenti anche sulla Vs pagina facebook.\r\nRestiamo aggiornati.\r\n\r\nB.giornata.\r\n\r\n\r\nGentilissimo Marco b.giorno,\r\n\r\nho letto tutto e ho stampato tutto.\r\n\r\nE\' tutto chiaro e attendo.\r\n\r\nRestiamo aggiornati.\r\n\r\nBuona giornata\r\n\r\n\r\n\r\nMAESTRO D\'ARTE (STUDIO DI ARCHITETTURA)\r\n\r\nAntonio GIAMMARIO\r\n\r\nWozz-App: 3291629899\r\n\r\nFacebook: Antonio Giammario\r\n\r\nSkype : antonio.giammario\r\n\r\nE-mail:aros83.ag@libero.itaros83.ag@libero.it\r\n\r\nTel.: 329/1629899', '2017-06-08 08:56:00', 6, -23, 771),
