(786, 6, 'RE: RE: Aggiornamenti da click day!', 'Buongiorno Domenico,\r\n               il suo contratto non  firmato, le chiedo la cortesia di caricarlo con la sua firma.\r\nIl compenso verr erogato a mezzo di bonifico bancario su IBAN da voi indicato.\r\nRimango a disposizione. Saluti Cordiali. Alessandro', '2017-06-08 09:10:00', 5625, -27, 771),
