(811, 5894, 'RE: RE: info fiscali', 'mi scusi cosa significa in caso di click vincente ? io ho letto che comunque per il buon esito della prestazione si viene pagati 300 netti e in caso di posizionamento tra i primi 3 si ha un premio supplementare, ma comunque il compenso per la prestazione svolta verr erogato,o vado errato?', '2017-06-08 12:46:00', 170, -22, 802),
