(813, 170, 'RE: RE: RE: info fiscali', 'Come ha detto nella seconda frase, si viene pagati per il buon esito del click.\r\nInoltre, sono previsti compensi ulteriori per i primi tre classificati.\r\n\r\nSaluti', '2017-06-08 12:52:00', 5894, -24, 802),
(814, 583, 'RE: AGGIORNAMENTI da Click Day 2017', 'Salve, io non potr pi parteciparvi poich ho trovato un impiego full time e  non sar in grado di usare il mio pc dalle 9 alle 18.\r\nC\' una specifica procedura da seguire, oppure basta semplicemente cancellare il mio account?\r\nGrazie, cordiali saluti\r\nAura Popovici', '2017-06-08 13:46:00', 6, -23, 366),
