(816, 169, 'RE: Info', 'ciao Ilaria, hai letto bene e con attenzione. effettivamente puoi aspettare a caricare il contratto che diventa utile e fondamentale ai fini del pagamento. quindi se farai il tempo utile per INAIL ad ammettere il progetto che ti assegneremo: dovrai caricarlo! prima non  strettamente necessario. Paolo\r\n', '2017-06-08 14:19:00', 5883, -24, 790),
