(818, 5939, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Carissimo, \r\n\r\nio sono gi impiegato attualmetne con contratto regolare a tempo determinato. In caso di successo il mio compenso di 300 euro potrebbe generare qualche problematica fiscale? L\'attivit  compatibile anche con un lavoro fisso a livello fiscale? Grazie.', '2017-06-08 14:34:00', 6, -23, 114),
(819, 3998, 'RE: RE:  Aggiornamenti da click day!_Antonio Giammario', 'Alessandro ciao,\r\nperfetto e credo di avere capito e spero bene.\r\nIncrociamo le dita.\r\nRestiamo aggiornati.\r\nGrazie sempre.\r\n\r\n\r\nMAESTRO D\'ARTE (STUDIO DI ARCHITETTURA)\r\n\r\nAntonio GIAMMARIO\r\n\r\nWozz-App: 3291629899\r\n\r\nFacebook: Antonio Giammario\r\n\r\nSkype : antonio.giammario\r\n\r\nE-mail:aros83.ag@libero.itaros83.ag@libero.it\r\n\r\nTel.: 329/1629899\r\n\r\n', '2017-06-08 14:58:00', 6, -23, 771),
(820, 5962, 'INFO', 'Salve essendo nuovo a tale progetto volevo assicurarmi non ci fossero penali/somme di denaro ecc da pagare in qualsiasi circostanza, grazie.', '2017-06-08 15:23:00', 170, -3, -1),
