(832, 259, 'RE: RE: RE: RE: Contratto', 'Bene, dovrei aver fatto tutto correttamente. Se volete controllate se ho caricato giusto il contratto. Speriamo di poter essere tra i click pi veloci. A presto. Buona serata. Debora', '2017-06-08 18:46:00', 170, -22, 797),
(833, 6015, 'contratto', 'Salve,\r\nvolevo sapere se devo caricare tutte e tre le pagine del contratto?', '2017-06-08 19:17:00', 197, -3, -1),
(834, 3607, 'RE: Aggiornamenti da click day!', 'Spero che il clickday non sia tra il 15 e il 17 giugno xche\' sono in viaggio. Se me lo perdo succede qualcosa? Potr  partecipare cmq alle altre edizioni  secisaranno?\r\nRestando in attesa di una pronta risposta saluto e ringrazio. ', '2017-06-09 05:27:00', 6, -23, 771),
(835, 5931, 'screenshot e tempi medi', 'Ciao! Ho appena caricato il contratto firmato. Posso avere maggiori informazioni sullo screenshot che bisogner produrre? E poi quali sono i tempi medi per poter immaginare di essere \"vincenti\"? - Claudio -', '2017-06-09 07:32:00', 6, -23, 771),
(836, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Francesco,\r\n                      il contratto di collaborazione adottato  compatibile con qualunque altra attivit fino ad un massimo annuale di euro 5.000 lordi con ritenuta di legge. Le consiglio comunque di chiedere confera ad un suo consulente.\r\nRimango a disposizione. Saluti Cordiali. Alessandro', '2017-06-09 07:36:00', 5939, -27, 114),
(837, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Irene, il contratto di collaborazione adottato  compatibile con qualunque altra attivit fino ad un massimo annuale di euro 5.000 lordi con ritenuta di legge. Le consiglio comunque di chiedere conferma ad un suo consulente. Rimango a disposizione. Saluti Cordiali. Alessandro', '2017-06-09 07:38:00', 5738, -27, 114),
