(860, 6, 'RE: contratto', 'Buongiorno Giancarlo,\r\n                      confermo che il contratto  necessario sia per regolarit amministrativa sia per sua tutela.  Non abbiamo inviato comunicazioni inerenti l\'inutilit del contratto. Le confermo di inviarlo firmato o caricandolo sul portale dalla sua area riservata oppure inviandolo a info@clickdayats.it . Rimango a disposizione. Saluti Cordiali.  Alessandro', '2017-06-09 11:41:00', 6073, -27, 859),
