(863, 6, 'RE: RE: RE: RE: Aggiornamenti da click day!', 'Buongiorno Domenico,\r\n                 le confero la correttezza del suo contratto, grazie. Per quanto riguarda l\'IBAN lo richiederemo solo a coloro che matureranno il compenso, questo per non richiedere dati eccedenti rispetto all\'essenziale al momento della registrazione. Entro una settimana dal clickday l\'INAIL pubblicher i risultati sul suo sito web, quindi oltre alla nostra comunicazione, potrete verificare in autonomia i risultati. L\'erogazione del compenso avverr entro 30 giorni dalla pubblicazione di questo elenco. Rimango a disposizione. Saluti Cordiali. Alessandro', '2017-06-09 11:58:00', 5625, -27, 771),
