(865, 6, 'RE: RE: RE: RE: RE: RE: Aggiornamenti da click day!', 'Il compenso  vincolato alla velocit di invio del codice progetto a lei assegnato.  In sostanza Domenico si tratta di un BANDO indetto dall\'Ente INAIL, alla sua settima edizione, che concede contributi alle aziende per il miglioramento delle condizione di salute e sicurezza dei lavoratori. Lei non avr alcun tipo di rapporto diretto con l\'INAIL. Il nostro Studio si occupa della presentazione di tali progetti e dei rapporti con l\'Ente, sia dal punto amministrativo sia tecnico, a seguito appunto del clickday, cio la procedura pubblicata dall\'INAIL per l\'assegnazione dei contributi. Si tratter di inviare un codice progetto che noi vi assegneremo, il pi velocemente possibile, in una data ed un orario esatto che l\'INAIL comunicher il 12 giugno 2017, tramite una pagina web statica dell\'INAIL. Il compenso maturer se l\'azienda cui  associato il suo codice rientrer fra quelle ammesse a contributo, pi veloci si invia la domanda pi  facile ottenere il compenso ed eventualmente i super compensi per i cliccatori pi veloci.\r\nSeguiranno nostre comunicazioni ed un video tutorial molto semplice che spiegher la procedura di invio del codice progetto. Qui trova comunque molte informazioni (domande e risposte): http://clickdayats.it/faq\r\nQui altre ancora: http://clickdayats.it/##comeFunziona\r\n\r\nRimango a disposizione.\r\nSaluti Cordiali.\r\nAlessandro\r\n', '2017-06-09 13:07:00', 5625, -27, 771),
