(891, 6, 'RE: RE: Aggiornamenti da click day!', 'Buongiorno Davide,\r\n           siamo in attesa della pubblicazione delle Regole Tecniche INAIL per l\'invio informatico dei codici che avverr a partire dal 12 giugno, medesima data in cui pubblicheranno il giorno e l\'ora esatta del clickday. Appena saranno pubblicate vi invieremo le istruzioni relative ed un video tutorial molto semplice con la procedura. Poi a partire dal 12 giugno sempre l\'Ente INAIL comunicher la data del clickday che si attester probabilmente entro le due settimane successive.\r\n\r\nRimango a disposizione.\r\nSaluti Cordiali\r\nAlessandro\r\n', '2017-06-11 10:00:00', 4529, -27, 771),
