(893, 6, 'RE: Aggiornamenti da click day!', 'Buongiorno Sara,\r\n            essendo un\'attivit lavorativa vera e propria, anche se della durata di pochi minuti, sia per regolarit amministrativa, sia per una sua tutela,  dovrebbe scaricare il contratto  dall\'apposito campo all\'interno della sua area  riservata e, dopo averlo firmato, caricarlo nella medesima area. Se le facesse  comodo pu inviarlo anche in allegato a info@clickdayats.it. Rimango a disposizione. Saluti Cordiali. Alessandro\r\n', '2017-06-11 10:06:00', 5972, -27, 771),
