(928, 4833, 'Info', 'Ciao! Volevo sapere se il mio contratto vi  arrivato? Faccio presente che l\'ho inviato non dopo cinque giorni, ma dopo due settimane...cambia qualcosa? Spero di potere avere presto i tutorial perch sarebbe la mia prima volta e vorrei poter fare al meglio. ', '2017-06-12 08:52:00', 170, -3, -1),
(929, 170, 'RE: Info', 'Buongiorno Sonia,\r\n\r\nl\'avviso che il contratto  stato caricato, ma  visibile solamente la seconda pagina.\r\n\r\nOccorre caricarlo correttamente.\r\n\r\nCerto, entro due giorni ricever il tutto.\r\n\r\nSaluti', '2017-06-12 08:57:00', 4833, -24, 928),
