(931, 6, 'RE: RE: Aggiornamenti da click day!', 'Buongiorno Massimo,\r\n          ovviamente non  una truffa,  un BANDO indetto dall\'Ente INAIL, alla sua settima edizione, che concede contributi alle aziende per il miglioramento delle condizione di salute e sicurezza dei lavoratori.  Qui trova il link al BANDO PUBBLICO:\r\nhttps://www.inail.it/cs/internet/comunicazione/avvisi-e-scadenze/scadenza-isi-2016-prima-fase.html .  Il nostro Studio si occupa della presentazione di tali progetti e dei rapporti con l\'Ente, sia dal punto amministrativo sia tecnico, a seguito appunto del clickday, cio la procedura pubblicata dall\'INAIL per l\'assegnazione dei contributi. Si tratter di inviare un codice progetto che noi vi assegneremo, il pi velocemente possibile, in una data ed un orario esatto che l\'INAIL comunicher A PARTIRE dal 12 giugno 2017, tramite una pagina web statica dell\'INAIL.\r\nSeguiranno nostre comunicazioni ed un video tutorial molto semplice che spiegher la procedura di invio del codice progetto. Qui trova comunque molte informazioni (domande e risposte): http://clickdayats.it/faq\r\nQui altre ancora: http://clickdayats.it/##comeFunziona\r\nMi chiami pure se ha altre domane allo 0522/701079\r\nRimango a disposizione.\r\nSaluti Cordiali.\r\nAlessandro\r\n', '2017-06-12 09:01:00', 5200, -27, 771),
