(968, 6, 'LA DATA del CLICK DAY: luned 19 giugno 2017 alle ore 16:00', 'Cari Cliccatori, l\'INAIL ha appena comunicato che la data del click day sar luned 19 giugno 2017 alle ore 16:00 esatte.\r\nATTENZIONE: vi ricordiamo che voi dovrete essere davanti al vostro pc alle ore 15.30 per essere in grado di eseguire la procedura di preparazione al click che vi spiegheremo nel video tutorial che riceverete via mail tra qualche giorno. Siamo ora in attesa (ma sar tra pochissimo!)  che lINAIL pubblichi le Regole Tecniche per linvio del codice progetto che ci serviranno per ultimare il video tutorial di cui sopra. \r\nSar nostra cura, appena possibile e comunque in anticipo rispetto al giorno del clickday, inviarvi tale video e il codice progetto a voi assegnato.\r\nSeguiranno altre indicazioni!\r\nLo Staff di ClickDayATS', '2017-06-12 13:53:00', -1, -15, -1),
