(1016, 5415, 'RE: LA DATA del CLICK DAY: luned 19 giugno 2017 alle ore 16:00', 'Buongiorno Alessandro, \r\ntutto chiaro.\r\nHo solo una domanda in merito ad un punto del contratto: 9. Tutte le clausole del presente atto sono da intendersi essenziali ed inderogabili, talch linosservanza di anche una sola di esse produrr ipso iure la risoluzione del contratto, con obbligo del risarcimento dei danni a carico della parte che si sar resa inadempiente.\r\n\r\nChe cosa si intende per risarcimento danni?\r\n\r\nGrazie.\r\nAngela', '2017-06-13 07:50:00', 6, -23, 968),
(1019, 6, 'RE: problema con caricamento del contratto', 'Buongiorno Veronica,\r\n              va benissimo la terza pagina con  le firme. Se preferisce pu inviare tutto a info@clickdayats.it. Rimango a disposizione. Saluti Cordiali. Alessandro', '2017-06-13 08:27:00', 6442, -27, 1008),
(1022, 6, 'RE: RE: LA DATA del CLICK DAY: luned 19 giugno 2017 alle ore 16:00', 'Buongiorno Angela,\r\n            le confermo che non sono previste penali o altro a carico del cliccatore, chiediamo  cortesemente che, nel caso fosse impossibilitata nell\'effettuare l\'invio ce lo comunichi entro il 18 giugno in modo da poterci organizzare. Alla domanda \r\n n. 12 qui http://clickdayats.it/faq trova la medesima rispsota.\r\nRimango a disposizione.\r\nSaluti Cordiali.\r\nAlessandro\r\n', '2017-06-13 08:45:00', 5415, -27, 968),
(1023, 6, 'PRESENTACI UN AMICO!', 'Caro Cliccatore, il CLIKDAY  vicinissimo!  Sei pronto per il CLICK?\r\nVuoi aumentare le tue possibilit di guadagno presentandoci i tuoi amici? \r\nSe vinceranno riceverai 50 netti per ogni click vincente. \r\n\r\nPer farlo baster copiare e inviare ai tuoi amici o conoscenti il link INVITA UN AMICO che trovi  nella sezione modifica dati personali allinterno della tua area riservata. Il link li reindirizzer alla pagina di iscrizione precompilata con un codice che corrisponde al tuo account  personale. \r\nI tuoi amici avranno cos la possibilit di partecipare al Clickday e in caso di successo ricevere il compenso spettante ai cliccatori, mentre tu riceverai un compenso di 50 netti per ogni click vincente effettuato dai tuoi amici. \r\nOgni volta che un tuo amico siscriver utilizzando il link che gli hai inviato, ti arriver un mail con indicato il nominativo del nuovo cliccatore. Circa una settimana dopo il clickday pubblicheremo lelenco completo dei cliccatori vincenti e tu potrai cos verificare il risultato dei tuoi amici.\r\n\r\nIn caso di successo dei tuoi amici potrai scaricare compilare e inviarci il nuovo contratto presente sulla tua area personale. Riceverai il tuo compenso con bonifico bancario, entro 30 giorni dalla pubblicazione degli elenchi cronologici dellINAIL che individuano i progetti vincenti che saranno resi pubblici dallINAIL il giorno 26 giugno 2017.\r\nLo Staff Click Day ATS', '2017-06-13 08:48:00', -1, -15, -1),
(1024, 5415, 'RE: RE: RE: LA DATA del CLICK DAY: luned 19 giugno 2017 alle ore 16:00', 'Salve Alessandro, \r\navevo gi letto il punto che mi ha segnalato, ma volevo una conferma in merito ad eventuali penali.\r\nE nell\'eventualit non potessi ve lo comunicher, di sicuro.\r\nGrazie.\r\nAngela', '2017-06-13 08:53:00', 6, -23, 968),
(1025, 17, 'RE: PRESENTACI UN AMICO!', 'Salve, io avrei invitato un mio amico, ma non c\'era ancora questa possibilit, se vi comunico la user, potete darmelo come invitato?\r\nSpero di si!', '2017-06-13 08:56:00', 6, -23, 1023),
