(1189, 3998, 'PRESENTACI UN AMICO!', 'Perfetto.\r\nCi proviamo.\r\nRestiamo aggiornati\r\n\r\nMAESTRO D\'ARTE (STUDIO DI ARCHITETTURA)\r\n\r\nAntonio GIAMMARIO\r\n\r\nWozz-App: 3291629899\r\n\r\nFacebook: Antonio Giammario\r\n\r\nSkype : antonio.giammario\r\n\r\nE-mail:aros83.ag@libero.itaros83.ag@libero.it\r\n\r\nTel.: 329/1629899', '2017-06-13 14:53:00', 6, -23, 1023),
(1190, -1, 'Nuovo Utente Registrato ClickDay 2017', 'Un nuovo utente si  registrato come tuo referral. Il suo nome  Andreea Pavel. Adesso hai 23 referral.', '2017-06-13 14:53:00', 173, -27, -1),
(1191, 3998, 'PRESENTACI UN AMICO!', 'Carissimo Alessandro,\r\ninviami gentilmente il link \"INVITA UN AMICO\".\r\nGrazie\r\n\r\nMAESTRO D\'ARTE (STUDIO DI ARCHITETTURA)\r\n\r\nAntonio GIAMMARIO\r\n\r\nWozz-App: 3291629899\r\n\r\nFacebook: Antonio Giammario\r\n\r\nSkype : antonio.giammario\r\n\r\nE-mail:aros83.ag@libero.itaros83.ag@libero.it\r\n\r\nTel.: 329/1629899', '2017-06-13 14:54:00', 6, -23, 1023),
(1192, -1, 'Nuovo Utente Registrato ClickDay 2017', 'Un nuovo utente si  registrato come tuo referral. Il suo nome  Andrea Gentili. Adesso hai 1 referral.', '2017-06-13 14:59:00', 6756, -27, -1),
(1193, 6, 'RE: domanda', 'Buongiorno Marco,\r\n         certamente, nessun problema.\r\nRimango a disposizione.\r\nSaluti Cordiali\r\nAlessandro\r\n', '2017-06-13 14:59:00', 4941, -27, 1188),
(1194, 6, 'RE: PRESENTACI UN AMICO!', 'Buongiorno Antonio,\r\n                  basta inviare il link INVITA UN AMICO che trova nella sezione modifica dati personali allinterno della sua area riservata. Il link reindirizzer alla pagina di iscrizione precompilata con un codice che corrisponde al tuo account personale. A quel punto il suo amico/a dovr registrarsi con i suoi dati come hai fatto lei. \r\nRimango a disposizione.\r\nSaluti Cordiali\r\nAlessandro\r\n', '2017-06-13 15:01:00', 3998, -27, 1023),
(1195, 6766, 'RE: Cosa fare ora che ti sei iscritto a Click Day?', 'salve dovrei mandare copia del contratto firmato, vorrei per sapere perch si riferisce a bando inail 2016.\r\ngrazie', '2017-06-13 15:04:00', 6, -23, 114),
(1196, 6, 'RE: RE: Cosa fare ora che ti sei iscritto a Click Day?', 'Buongiorno Cristiana,\r\n               tutto corretto, il BANDO viene pubblicato ogni anno in dicembre,  quest\'ultimo appunto il 23 dicembre 2016. Il click day  relativo di conseguenza al 2017. Rimango a disposizione. Saluti Cordiali. Alessandro\r\n', '2017-06-13 15:07:00', 6766, -27, 114),
