(1201, 4009, 'Link di invito amici', 'Buongiorno alessandro,\r\nho appena letto la mail \"presentaci un amico\", ma guardando il link nell\'area di modifica dati personali non mi sembra che sia un link personalizzato.\r\nHo provato anche ad aprirlo tramite finestra di navigazione in incognito e non ho notato nessun campo collegato esplicitamente al mio account.\r\nMi sono perso qualche passaggio o  normale che sia cos?\r\nAttendo tue notizie.\r\nBuona giornata.\r\nAndrea', '2017-06-13 15:15:00', -1, -1, -1),
